(4, '1', 'type_to', '<p><strong>La Nina</strong> memiliki pengaruh yang besar terhadap musim di Indonesia khususnya musim penghujan, yaitu dengan memicu pertumbuhan awan konvektif di atas wilayah Indonesia yang akan menghasilkan banyak hujan. <strong>La Nina</strong> yang dimaksud adalah:</p>', 'Anomali memanasnya suhu permukaan laut di Samudra Pasifik bagian ekuator', 'Anomali mendinginnya suhu permukaan laut di pantai timur Pasifik bagian ekuator', 'Anomali memanasnya suhu permukaan laut di Samudra Atlantik bagian ekuator', 'Anomali mendinginnya suhu permukaan laut di Samudra Atlantik bagian ekuator', 'Anomali memanas atau mendinginnya suhu permukaan laut di Samudra Hindia ekuator', '', '', '', '', '', 'B', 3),
(5, '2', 'type_to', '<p>Suatu daerah yang terbangun pada pinggiran kota yang bisa disebut sebagai daerah atau kawasan marjinal dengan berkarakteristik <strong>&ldquo;desa bukan dan kota belum&rdquo;</strong> adalah...</p>', 'Urban center', 'Suburban', 'Rural fringe', 'Rural center', 'Urban fringe', '', '', '', '', '', 'E', 2),
(6, '3', 'type_to', '<p>Suatu kota yang terjadi banyak kekacauan di dalamnya, mulai dari kekacauan pelayanan umum, banyak tindak kejahatan, lalu lintas padat adalah...</p>', 'Eopolis', 'Tryanopolis', 'Polis', 'Necropolis', 'Megapolis', '', '', '', '', '', 'B', 2),
(7, '4', 'type_to', '<p>Berdasarkan hasil citra indraja, dapat diketahui bahwa sungai yang berada di kawasan gunung yang memiliki bentuk kerucut memiliki pola...</p>', 'Annular', 'Radial sentripetal', 'Radial sentrifugal', 'Pinnate', 'Dendritik', '', '', '', '', '', 'C', 2),
(8, '5', 'type_to', '<p>Proses terjadinya angin monsun Barat Daya adalah ketika terjadi angin tenggara dari benua Australia yang merupakan wilayah dengan tekanan tinggi. Apa yang terjadi setelah angin tersebut berhembus melintasi khatulistiwa?</p>', 'Berbalik menuju Barat Daya', 'Berhembus menuju Barat Laut', 'Mengalami pembelokan oleh Gaya Coriolis ke Barat', 'Mengalami pembelokan ke Timur Laut', 'Tidak ada pilihan jawaban yang benar', '', '', '', '', '', 'D', 3),
(9, '6', 'type_to', '<p>Di Indonesia terdapat danau yang memiliki air asin yaitu danau Satonda di Bima, Nusa Tenggara Barat. Apa yang menjadi penyebab danau tersebut menjadi danau air asin?</p>', 'Danau yang lebih rendah daripada permukaan air laut', 'Intrusi air laut yang terjadi pada danau tersebut', 'Air laut yang tertangkap di dalam batuan', 'Evaporasi yang besar terjadi pada danau', 'Partikel yang terkandung dalam air danau', '', '', '', '', '', 'C', 3),
(11, '7', 'type_to', '<p><strong>Likuefaksi</strong> pernah terjadi di kota Palu yang menyebabkan Palu menjadi zona rawan bencana. Salah satu penyebab dari terjadinya <strong>likuefaksi</strong> di Palu adalah...</p>', 'Terdapat endapan aluvial muda', 'Di atas graben aktif', 'Dekat dengan zona subduksi', 'Sedimen yang basah', 'Perilaku manusia', '', '', '', '', '', 'A', 3),
(12, '8', 'type_to', '<p><strong>GIS</strong> menghasilkan suatu peta dengan skala, 1:4000. Dari peta tersebut didapatkan <strong>kontur</strong> yang memiliki beda tinggi dari titik A ke B adalah 13 m, sedangkan jarak dari titik A ke B di peta adalah 13 cm. Hitunglah <strong>slope</strong> dari titik A ke titik B!</p>', '2,3%', '2,4%', '2,5%', '2,6%', '2,7%', '', '', '', '', '', 'C', 4),
(13, '9', 'type_to', '<p>Pada suatu daerah yang memiliki sifat dan kesesuaian lahan dengan tingkat kemiringan lereng 3-9% adalah...</p>', 'Kurang sesuai untuk lapangan terbang, tetapi baik untuk industri berat, irigasi terbatas, dan dry farming', 'Cocok untuk daerah rekreasi, tempat peristirahatan, buffer tanaman hutan, atau padang rumput', 'Cocok untuk pengembangan permukiman, tetapi kurang sesuai untuk industri ringan dan dry farming', 'Cocok untuk cultivation, industri ringan, bangunan rendah, kompleks pemukiman atau', 'Cocok untuk daerah rekreasi dan untuk lapangan terbang fasilitas rekreasi', '', '', '', '', '', 'A', 4),
(14, '10', 'type_to', '<p>Pada suatu wilayah memiliki jumlah penduduk pada awal perhitungan adalah 15.000 jiwa. Lima tahun kemudian jumlah kelahiran penduduk di wilayah tersebut adalah 6000 jiwa dan jumlah kematian penduduk adalah 5000 jiwa. Berapakah presentasi pertumbuhan penduduk pada wilayah tersebut?</p>', '6.26%', '6,47%', '6,67%', '7,26%', '7,67%', '', '', '', '', '', 'C', 4),
(15, '11', 'type_to', '<p>Letusan Gunung Semeru menghasilkan frekuensi getaran yang tinggi. Melalui pengamatan gelombang, diketahui bahwa rerata frekuensi getaran yang dihasilkan gempa vulkanik lebih tinggi daripada tektonik. Hal tersebut disebabkan oleh...</p>', 'Setiap erupsi disertai gempa berkali-kali', 'Energi gempa dilepaskan secara bertahap', 'Cadangan energi gempa vulkanik besar', 'Jumlah gunung api banyak dengan distribusi merata', 'Pasca gempa tektonik selalu diikuti erupsi gunung api', '', '', '', '', '', 'B', 2),
(16, '12', 'type_to', '<p>Wilayah di suatu kecamatan di Kota Batu memiliki karakteristik lahan yang sesuai untuk lokasi pemukiman penduduk. Padahal, wilayah Kota Batu mencirikan daerah pegunungan, tetapi dapat terhindarkan dari bencana longsor. Ciri khas lahan suatu kecamatan tersebut adalah...</p>', 'Batuan keras dan lereng curam', 'Batuan berlapis dan lereng landai', 'Batuan lepas-lepas dan lereng terjal', 'Batuan masif dan lereng landai', 'Batuan berpori dan lereng miring', '', '', '', '', '', 'D', 2),
(17, '13', 'type_to', '<p>Dataran banjir yang ada pada wilayah Bojonegoro merupakan lokasi yang potensial untuk dimanfaatkan sebagai persawahan. Alasan dari pernyataan tersebut adalah...</p>', 'Air tanahnya dangkal', 'Ketersediaan air melimpah', 'Genangan air yang dangkal dengan distribusi merata', 'Berada di sekeliling sungai permanen', 'Debit aliran air tinggi', '', '', '', '', '', 'B', 2),
(18, '14', 'type_to', '<p>Perluasan tambak ikan yang banyak dilakukan oleh masyarakat Pesisir Utara Jawa Tengah dilakukan dengan menghilangkan hutan bakau. Aksi tersebut telah berlangsung bertahun-tahun hingga kini wilayah pantai mengalami kerusakan. Adapun dampak dari perluasan tambak dengan cara tersebut adalah...</p>', 'Terjadinya akresi akibat pola sedimentasi berubah', 'Arus sejajar pantai', 'Pelurusan garis pantai', 'Terjadi pengikisan pantai', 'Produktivitas tambak menurun', '', '', '', '', '', 'D', 3),
(19, '15', 'type_to', '<p>Pulau Kalimantan sejatinya memiliki potensi sumber daya energi geothermal. Namun, potensi tersebut tidak cukup besar dibandingkan pulau-pulau lain di Indonesia. Rendahnya potensi tersebut diakibatkan oleh...</p>', 'Wilayah yang berupa daratan', 'Teknologi yang tidak dapat menjangkau wilayah', 'Rendahnya aktivitas vulkanik', 'Sebagian besar tanahnya berupa gambut', 'Reservoir fluida panas di Kalimantan berada di kedalaman tinggi', '', '', '', '', '', 'C', 3),
(20, '16', 'type_to', '<p>Surabaya merupakan wilayah yang dikategorikan sebagai pusat pertumbuhan dengan daya dukung regional yang memadai. Karakteristik yang sesuai dengan keadaan Kota Surabaya sehingga dapat dikategorikan sebagai pusat pertumbuhan adalah...</p>', 'Jumlah penduduk banyak, tumbuh dengan cepat dengan berbagai latar belakang motif dan ekonomi', 'Sarana prasarana yang terdapat di Surabaya sangat maju', 'Harga tanah yang stabil dan memberikan pengaruh pada wilayah lain', 'Kegiatan ekonomi yang memiliki nilai transaksi tinggi perhariannya', 'Perkembangan ekonomi yang sangat cepat', '', '', '', '', '', 'E', 4),
(21, '17', 'type_to', '<p>Pulau Jawa merupakan pulau dengan konsentrasi penduduk tertinggi di Indonesia dengan 56,1% populasi masyarakat Indonesia tinggal di Pulau Jawa. Kepadatan populasi yang tinggi menimbulkan masalah-masalah sosial baru. Adapun permasalahan yang dapat muncul adalah...</p>', 'Beban tanggungan, tekanan, dan persaingan penduduk terhadap lahan tinggi', 'Struktur penduduk muda, kepadatan penduduk, dan kemiskinan tinggi', 'Kepemilikan lahan sempit, kepadatan tinggi, dan struktur penduduk muda', 'Mutasi lahan, ketahanan pangan rendah, dan persaingan penggunaan lahan', 'Pengangguran, kemiskinan, dan kepadatan penduduk sangat tinggi', '', '', '', '', '', 'E', 4),
(22, '18', 'type_to', '<p>Menurut data pada tahun 2016, Indonesia merupakan salah negara konsumen BBM terbesar di dunia dengan konsumsi 1,6 juta bph. Demi mengurangi konsumsi dan polusi udara akibat BBM yang semakin meningkat, perlu upaya pengurangannya. Upaya pengurangan untuk menekan konsumsi serta polusi udara adalah...</p>', 'Menginovasikan teknologi carbon capture memanfaatkan potensi alam', 'Mengembangkan energi alternatif dari limbah anorganik yang banyak dibuang sembarangan', 'Mengembangkan energi alternatif dengan bahan organik', 'Memperketat aturan jual-beli serta perpajakan kendaraan bermotor', 'Menggunakan teknologi AI pada pabrik untuk mengefisiensikan energi', '', '', '', '', '', 'C', 4),
(23, '19', 'type_to', '<p>Kota Surabaya merupakan salah satu kota dengan tingkat kemacetan tinggi di Indonesia. Demi mengurai tingkat kemacetan yang tinggi diperlukan analisis tingkat kemacetan terlebih dahulu. Penggunaan data spasial menjadi salah satu cara efektif untuk menganalisis tingkat kemacetan. Adapun variabel yang dapat digunakan adalah...</p>', 'Jalur transportasi dan jenis kendaraan', 'Klasifikasi dan kualitas jalan', 'Pusat kegiatan penduduk dan kondisi jalan', 'Jalur transportasi dan lebar/panjang jalan', 'Daya tampung dan jalur transportasi', '', '', '', '', '', 'D', 4),
(24, '20', 'type_to', '<p>Di kota-kota dengan perkembangan yang pesat, mengalami suatu fenomena desentralisasi permukiman. Adapun fenomena desentralisasi pemukiman tersebut ditandai dengan...</p>', 'Pembangunan pemukiman yang diserahkan pada developer', 'Pemukiman kelompok menengah ke atas yang cenderung memisah', 'Pemukiman penduduk bergeser ke arah pinggiran', 'Masyarakat diberi kebebasan mengembangkan pemukiman', 'Meluasnya area pemukiman kumuh di kota', '', '', '', '', '', 'B', 4),
(25, '21', 'type_to', '<p>Rani merupakan ahli geologi baru dalam suatu pertambangan swasta. Perusahaan pertambangan tersebut memiliki izin untuk beroperasi menambang barang tambang golongan A. Barang tambang yang akan diambil Rani adalah...</p>', 'Minyak bumi, emas, perak', 'Emas, perak, platina', 'Batu bara, minyak bumi, timah', 'Minyak bumi, marmer, fosfat', 'Batu gamping, marmer, gipsum', '', '', '', '', '', 'C', 2),
