(52, '48', 'type_to', '<p>Terdapat 2021 lampu beserta sakelar untuk menyalakan dan mematikan lampu. Mula-mula semua lampu dalam keadaan padam. Dalam waktu satu menit, Amat dapat menekan tepat 5 sakelar secara bersamaan. Setiap Amat menekan saklar, lampu yang sebelumnya padam menjadi menyala dan yang sebelumnya menyala menjadi padam. Untuk menyalakan semua lampu tersebut, Amat memerlukan paling sedikit ... menit.</p>', '406', '407', '408', '409', '401', '', '', '', '', '', 'B', 2),
(53, '49', 'type_to', '<p>Pada suatu parkiran, terdapat mobil dan motor. Jumlah motor adalah setengah dari jumlah mobil. Jumlah roda yang ada di parkiran tersebut adalah 100. Jumlah kendaraan yang terparkir di parkiran tersebut adalah...</p>', '10', '20', '25', '30', '15', '', '', '', '', '', 'D', 2),
(54, '50', 'type_to', '<p>Suatu percobaan interferensi celah ganda menghasilkan jarak celah ganda dengan layar sebesar 3.5 m. Cahaya ditembakkan dari lubang celah ganda yang memiliki panjang gelombang 650 nm dengan jarak antara 2 celah tersebut sebesar 0.3 mm. Pilihlah pernyataan berikut yang benar:</p>\r\n<p>1. Jarak pita gelap kedua ke pusat sebesar 12 mm</p>\r\n<p>2. Jarak pita terang kedua ke gelap kedua sebesar 3 mm</p>\r\n<p>3. Untuk memperbesar jarak pita terang-n terhadap pusat maka kita bisa memperbesar jarak antar 2 celah</p>', '1, 2, dan 3', '1 dan 3', '1 dan 3', '2 dan 3', 'Tidak ada pilihan jawaban yang benar', '', '', '', '', '', 'E', 2),
