(59, '55', 'type_to', '<p>Perhatikan faktor-faktor berikut!</p>\r\n<p>1) Massa jenis zat cair</p>\r\n<p>2) Berat benda</p>\r\n<p>3) Kedalaman posisi benda dari permukaan</p>\r\n<p>4) Luas permukaan benda</p>\r\n<p>Faktor-faktor yang mempengaruhi besar tekanan hidrostatis pada zat cair ditunjukkan oleh nomor...</p>', '1, 2, dan 3', '1 dan 3', '2 dan 3', '3 dan 4', 'Tidak ada pilihan jawaban yang benar', '', '', '', '', '', 'B', 2),
(60, '56', 'type_to', '<p>Balok P seberat 100 N diikat dengan tali mendatar pada tembok. Balok Q yang memiliki berat 500 N ditarik dengan gaya luar F. Jika koefisien gesek antara kedua balok = 0,2 dan koefisien gesek antara balok Q dengan meja = 0,5. Berapa F minimum agar balok Q dapat ditarik?</p>', '300 N', '320 N', '440 N', '230 N', '350 N', '', '', '', '', '', 'B', 2),
