(62, '58', 'type_to', '<p>Sebuah es memiliki massa 100 gram pada temperatur -10&deg;C. Kalor yang dibutuhkan untuk meleburkan es menjadi setengah dari massa semula adalah &hellip;. kal.</p>\r\n<p>*(titik lebur es = 0&deg;C, kalor jenis es = 0,5 kal/g&deg;C, kalor lebur es = 80 kal/g)</p>', '1500', '2000', '3000', '4500', '5000', '', '', '', '', '', 'D', 3),
(63, '59', 'type_to', '<p>Dari suatu ketinggian sebuah benda dengan massa 1 kg dilempar ke bawah dengan kecepatan awal 6 m/s kemudian beberapa saat kemudian kecepatannya berubah menjadi 10 m/s. kerja yang dilakukan oleh gaya gravitasi adalah ... Joule</p>', '68', '64', '34', '36', '32', '', '', '', '', '', 'E', 3),
(68, '60', 'type_to', '<p>Salah satu teori fisika modern yang terkenal dalam dunia astronomi adalah <strong>Hukum Kepler</strong>, yang menjelaskan tentang gerakan suatu objek bermassa yang sangat besar sehingga mempengaruhi benda sekitar yang mengitarinya juga dengan berbagi macam bentuk lintasan. Suatu objek tak dikenal mengorbit dengan jarak <img src="images/SSF1.png" alt="" width="44" height="21" />&nbsp;km terhadap bintang XV yang bermassa&nbsp;<img src="images/SS2.png" alt="" width="48" height="19" /> kg. Tentukan berapa periode edar untuk sekali putaran objek tersebut!</p>', '6,5 Tahun', '6,3 Tahun', '6,1 Tahun', '6,2 Tahun', '6,4 tahun', 'JWB_A_60.', 'JWB_B_60.', 'JWB_C_60.', 'JWB_D_60.', 'JWB_E_60.', 'C', 4),
(69, '61', 'type_to', '<p>Sebuah peluru dengan massa, bentuk, dan gaya gesek udara dapat diabaikan ditembakkan dengan kecepatan awal V0 = 10 m/s dengan sudut tembakan &alpha;=60&deg; terhadap horizontal. Peluru tersebut ditembakkan pada bidang miring yang memiliki panjang bidang miring S dengan salah satu sudut segitiga atas &beta;=60&deg;. Tentukan panjang bidang miring (S)!</p>\r\n<p><img src="images/SS3.png" alt="" width="294" height="215" /></p>', '(960/3) meter', '(1080/3) meter', '(1280/3) meter', '(1360/3) meter', '(1060/2) meter', '', '', '', '', '', 'C', 4),
(70, '62', 'type_to', '<p>Seseorang menaruh gelas berisi air yang diketahui koefisien viskositasnya&nbsp;<img src="images/SS4.png" alt="" width="114" height="19" /> di atas piringan berputar. Berapakah koefisien gesek gelas tersebut agar gelas tetap di posisinya jika gelas berjarak 1,50 meter dengan kecepatan piring 2 m/s?</p>', '0,272', '0,336', '0,452', '0,102', '0,244', '', '', '', '', '', 'A', 3),
(71, '63', 'type_to', '<p>Suatu mesin memiliki 2 komponen tabung identik yang diberi label A dan B. Mula-mula tabung A berisi gas pada suhu 27&deg; C dan tekanan&nbsp;<img src="images/SS5.png" alt="" width="22" height="18" /> Pa. Tabung B mula-mula kosong. Kemudian kedua tabung saling dihubungkan dan dipanaskan hingga suhu 147&deg; C. Perbedaan tekanan kedua tabung pada keadaan akhir adalah 1,1 atm. Hitunglah tekanan tabung B pada keadaan akhir!</p>', '3,20 atm', '0,10 atm', '2,50 atm', '0,15 atm', '3,40 atm', '', '', '', '', '', 'C', 4),
(72, '64', 'type_to', '<p>Di dalam kota Elipsoid City akan diadakan kompetisi Geosentric. Luas wilayah yang akan digunakan untuk acara tersebut berbentuk lingkaran seluas <img src="images/SSM1.png" alt="" width="38" height="18" />. Di dalam lingkaran pertama dibuat lingkaran lagi dengan jari-jari selisih 1,5 meter dari jari-jari lingkaran pertama dan lebih tinggi 10 cm. Dan seterusnya akan dibuat lingkaran dengan selisih jari-jari 1,5 meter dan ketinggian 10 cm dari lingkaran sebelumnya. Luas permukaan daerah ke-9 (Dengan selimut tabung) adalah...</p>\r\n<p><img src="images/SSM2.jpg" alt="" width="181" height="192" /></p>', '228Ï€', '123,2Ï€', '82,8Ï€', '292,4Ï€', '171,6Ï€', '', '', '', '', '', 'E', 3),
