(108, '95', 'type_to', '<p>Seorang Mahasiswa Teknik Geomatika ITS ingin berangkat dari rumah yang berada di titik&nbsp; (0,0) ke kampus ITS yang berada di titik (11,8).&nbsp; Mahasiswa tersebut hanya dapat berjalan ke arah sumbu positif (ke kanan dan ke atas bidang kartesian) sejauh 1 satuan saja. untuk pergi ke kampus, biasanya mahasiswa tersebut memakai rute dari rumah yang melewati Bundaran Air Mancur Menari ITS. Dari semua rute dari rumah ke kampus, peluang mahasiswa tersebut tidak menggunakan rute tersebut adalah...</p>', '', '', '', '', '', 'JWB_A_95.png', 'JWB_B_95.png', 'JWB_C_95.png', 'JWB_D_95.png', 'JWB_E_95.png', 'A', 4),
(109, '96', 'type_to', '<p>Sebuah bola bermassa m diikatkan di atas batang besi dan diayunkan secara melingkar dengan sudut &alpha; tali terhadap batang pemutar. R adalah jarak bola terhadap batang secara horizontal, dan T adalah tegangan tali. Apabila nilai kecepatan minimum agar bola tetap berputar di bidang lingkarannya adalah V, maka nilai tan &alpha; adalah...</p>', '', '', '', '', '', 'JWB_A_96.png', 'JWB_B_96.png', 'JWB_C_96.png', 'JWB_D_96.png', 'JWB_E_96.png', 'E', 4),
(110, '97', 'type_to', '<p>Berikut ilustrasi bendungan yang memiliki kedalaman (D) = 35 m, lebar muka bendungan (W) = 314 m, jika massa jenis air adalah &rho; maka total momen gaya bendungan dari titik dasar bendungan hingga ke atas dan selebar bendungan tersebut adalah...</p>\r\n<p><img src="images/SSF7.png" alt="" width="430" height="202" /></p>', '', '', '', '', '', 'JWB_A_97.png', 'JWB_B_97.png', 'JWB_C_97.png', 'JWB_D_97.png', 'JWB_E_97.png', 'A', 4),
(111, '98', 'type_to', '<p>Konstanta gas adalah konstanta kesebandingan terhadap kejadian yang menghubungkan skala energy dengan skala suhu, sebagai acuan yaitu suhu dasar terhadap mol partikel. Bagaimana konstanta gas dituliskan dalam bentuk dimensi?</p>', '', '', '', '', '', 'JWB_A_98.png', 'JWB_B_98.png', 'JWB_C_98.png', 'JWB_D_98.png', 'JWB_E_98.png', 'E', 2),
(112, '99', 'type_to', '<p>Suatu kincir horizontal yang mengeluarkan air dari ujung-ujungnya adalah inovasi baru bagi pembangkit listrik tenaga terbarukan. Jika panjang setiap lengan adalah r, luas penampang tiap mulut kincir adalah A, massa tiap lengan adalah m, dan torsi total adalah T. Jika debit yang dikeluarkan tiap lengan adalah sama, maka dapat digambarkan sebagai berikut:</p>\r\n<p><img src="images/SSF9.png" alt="" width="385" height="194" /></p>\r\n<p>Massa katrol tanpa selip&nbsp; adalah M, jari-jari katrol R, dan berat dari beban yang digantung adalah W. Apabila kecepatan sudut katrol yang diharapkan sama dengan kecepatan sudut pada kincir sebelumnya, bagaimana penjabaran untuk jari-jari katrol tersebut jika katrol dianggap roda pejal homogen?</p>', '', '', '', '', '', 'JWB_A_99.png', 'JWB_B_99.png', 'JWB_C_99.png', 'JWB_D_99.png', 'JWB_E_99.png', 'A', 4),
(113, '100', 'type_to', '<p>Sebuah benda ditimbang dalam air beratnya 60 N. Jika massa jenis benda tersebut adalah&nbsp;<img src="images/SSF10.png" alt="" width="93" height="25" /> maka berat benda tersebut di udara adalah ... N.</p>', '180', '120', '90', '45', '40', '', '', '', '', '', 'C', 2),
(114, '1', 'type_a', '<p>Terdapat dua buah lingkaran A dan lingkaran B dengan jari-jarinya berturut-turut adalah 9 dan 4 satuan panjang dan bersinggungan di luar pada titik P. Jika Q merupakan perpotongan garis singgung persekutuan luarnya, nilai &lfloor;PQ&rfloor; dengan PQ merupakan jarak antara titik P dan Q adalah&hellip;</p>', '14', '30', '15', '10', '12', 'JWB_A_1.', 'JWB_B_1.', 'JWB_C_1.', 'JWB_D_1.', 'JWB_E_1.', 'A', 3),
(115, '2', 'type_a', '<p>Sebuah kertas berbentuk persegi panjang A dengan AB = 12 dan BC = 16. Jika kertas dilipat mengikuti diagonal AC dengan B&rsquo; merupakan posisi titik B setelah kertasnya dilipat, maka&nbsp; panjang B&rsquo;D adalah&hellip;</p>', '', '', '', '', '', 'JWB_A_2.png', 'JWB_B_2.png', 'JWB_C_2.png', 'JWB_D_2.png', 'JWB_E_2.png', 'C', 3),
(116, '3', 'type_a', '<p>Perhatikan gambar berikut</p>\r\n<p><img src="images/MA31.png" alt="" width="156" height="242" /></p>\r\n<p>Apabila</p>\r\n<p>&ang;AOB=&alpha;</p>\r\n<p>&ang;AXB=&gamma;</p>\r\n<p>Maka &ang;COD=...</p>', '', '', '', '', '', 'JWB_A_3.png', 'JWB_B_3.png', 'JWB_C_3.png', 'JWB_D_3.png', 'JWB_E_3.png', 'C', 2),
(117, '4', 'type_a', '<p>Diketahui&nbsp;<img src="images/MA41.png" alt="" width="189" height="31" /> .</p>\r\n<p>Jika a,b, dan c merupakan solusi nilai x yang mungkin, maka nilai dari <img src="images/MA42.png" alt="" width="123" height="30" /> adalah &hellip;</p>', '4/9', '9/5', '4', '6/5', '2/5', 'JWB_A_4.', 'JWB_B_4.', 'JWB_C_4.', 'JWB_D_4.', 'JWB_E_4.', 'C', 4),
(118, '5', 'type_a', '<p>Diketahui terdapat sebuah parabola dengan persamaan&nbsp;<img src="images/MA51.png" alt="" width="144" height="26" /> .</p>\r\n<p>Jika parabola tersebut melalui titik (2,3) dan (4,3), maka nilai c yang memenuhi adalah&hellip;</p>', '-11', '1', '5', '11', '9', 'JWB_A_5.', 'JWB_B_5.', 'JWB_C_5.', 'JWB_D_5.', 'JWB_E_5.', 'D', 2),
(119, '6', 'type_a', '<p>Jika rata-rata 20 bilangan bulat non-negative berbeda adalah 20, maka bilangan terbesar yang mungkin adalah...</p>', '221', '229', '859', '239', '494', 'JWB_A_6.', 'JWB_B_6.', 'JWB_C_6.', 'JWB_D_6.', 'JWB_E_6.', 'B', 2),
(120, '7', 'type_a', '<p>Dua buah dadu dengan sisinya dicat merah dan biru. Dadu pertama terdiri dari 5 sisi merah dan 1 sisi biru. Jika kedua dadu tersebut dilempar, maka peluang munculnya sisi dadu berwarna sama adalah 0,5.</p>\r\n<p>Jumlah sisi dadu kedua yang berwarna merah adalah&hellip;</p>', '3', '4', '5', '6', '0', 'JWB_A_7.', 'JWB_B_7.', 'JWB_C_7.', 'JWB_D_7.', 'JWB_E_7.', 'A', 3),
(121, '8', 'type_a', '<p>Segi empat ð´ðµð¶ð· adalah sebuah trapesium dengan ADâˆ¥BC, digambarkan pada bidang koordinat kartesius.</p>\r\n<p>Diketahui ð·ð¶ tegak lurus ð¶ðµ, ð´(0,6), dan ðµ(8,4). Titik ð· terletak pada sumbu ð‘¦ dan titik ð¶ terletak pada sumbu ð‘¥.</p>\r\n<p>Jika luas persegi dengan koordinat (0,0),(1,0),(1,1), dan (0,1) adalah 8 satuan luas, maka luas ð´ðµð¶ð· adalah...</p>', '280', '180', '320', '240', '160', 'JWB_A_8.', 'JWB_B_8.', 'JWB_C_8.', 'JWB_D_8.', 'JWB_E_8.', 'D', 2),
(122, '9', 'type_a', '<p><img src="images/MA91.png" alt="" width="321" height="39" /></p>\r\n<p>Banyaknya penyelesaian bilangan asli x dari persamaan tersebut adalah...</p>\r\n<p>&nbsp;</p>', '1', '2', '3', '4', '0', 'JWB_A_9.', 'JWB_B_9.', 'JWB_C_9.', 'JWB_D_9.', 'JWB_E_9.', 'B', 3),
(123, '10', 'type_a', '<p>Diketahui persamaan berikut</p>\r\n<p><img src="images/MA101.png" alt="" width="183" height="56" /></p>\r\n<p>Berdasarkan persamaan tersebut, nilai m &ndash; n adalah...</p>', '3', '2', '1', '-1', '-2', 'JWB_A_10.', 'JWB_B_10.', 'JWB_C_10.', 'JWB_D_10.', 'JWB_E_10.', 'A', 3),
(124, '11', 'type_a', '<p>Diberikan belah ketupat ABCD. Titik P, Q, R, dan S berturut-turut merupakan titik berat segitiga ABC, BCD, CDA, dan DAB. Perbandingan luas belah ketupat PQRS dan ABCD adalah...</p>', '1 : 3', '1 : 6', '1 : 9', '1 : 27', '1 : 12', 'JWB_A_11.', 'JWB_B_11.', 'JWB_C_11.', 'JWB_D_11.', 'JWB_E_11.', 'C', 4),
(125, '12', 'type_a', '<p>Seseorang ingin membuat suatu perumahan berbentuk lingkaran dengan pusat (0,0) dan berjari-jari 2 satuan. Jika semua rumah dalam perumahan tersebut berada pada koordinat bilangan bulat, maka peluang dua buah rumah berjarak lebih dari 3 satuan adalah&hellip;</p>', '10/39', '5/39', '8/39', '4/39', '14/39', 'JWB_A_12.', 'JWB_B_12.', 'JWB_C_12.', 'JWB_D_12.', 'JWB_E_12.', 'B', 4),
(126, '13', 'type_a', '<p>Peluang sebuah koin menunjukkan gambar ketika ditos adalah 1/3.</p>\r\n<p>Diketahui bahwa peluang muncul tempat 2 gambar dan 4 angka ketika koin tersebut ditos 6 kali dapat dituliskan dalam bentuk m/n di mana m dan n bilangan asli yang relatif prima.</p>\r\n<p>Nilai dari m + n adalah&hellip;</p>', '725', '733', '737', '731', '721', 'JWB_A_13.', 'JWB_B_13.', 'JWB_C_13.', 'JWB_D_13.', 'JWB_E_13.', 'B', 2),
(127, '14', 'type_a', '<p>Diketahui, terdapat suatu grafik dengan persamaan&nbsp;<img src="images/MA141.png" alt="" width="78" height="44" /> .</p>\r\n<p>Jika gradien dari garis singgung pada titik (-1, 3) adalah m, maka nilai m yang dimaksud adalah&hellip;</p>', '-1', '1', '1/4', '-1/4', '4', 'JWB_A_14.', 'JWB_B_14.', 'JWB_C_14.', 'JWB_D_14.', 'JWB_E_14.', 'A', 2),
(128, '15', 'type_a', '<p>Diketahui&nbsp;<img src="images/MA151.png" alt="" width="139" height="53" /> .</p>\r\n<p>Jika F(x) merupakan bentuk anti turunan dari f(x), maka persamaan F(x) adalah&hellip;</p>', '', '', '', '', '', 'JWB_A_15.png', 'JWB_B_15.png', 'JWB_C_15.png', 'JWB_D_15.png', 'JWB_E_15.png', 'A', 4),
(129, '16', 'type_a', '<p>Diketahui&nbsp;<img src="images/MA161.png" alt="" width="104" height="54" /> dan&nbsp;<img src="images/MA162.png" alt="" width="134" height="49" /> .</p>\r\n<p>Berdasarkan matriks tersebut, hasil akhir dari&nbsp;<img src="images/MA163.png" alt="" width="228" height="60" /> dengan invers dan transpose berulang sebanyak 2020 kali dan diakhiri invers adalah&hellip;</p>', '', '', '', '', '', 'JWB_A_16.png', 'JWB_B_16.png', 'JWB_C_16.png', 'JWB_D_16.png', 'JWB_E_16.png', 'D', 3),
(130, '17', 'type_a', '<p>Titik (a, a) dirotasikan dengan pusat (0, 0) sebesar 60&deg;.</p>\r\n<p>Kemudian direfleksikan terhadap sumbu-x.</p>\r\n<p>Agar Kembali ke titik (a, a), titik harus dirotasikan dengan pusat (0,0) sebesar&hellip;</p>', '120Â°', '150Â°', '180Â°', '210Â°', '60Â°', 'JWB_A_17.', 'JWB_B_17.', 'JWB_C_17.', 'JWB_D_17.', 'JWB_E_17.', 'B', 3),
(131, '18', 'type_a', '<p>Diketahui terdapat tiga buah sudut A, B, dan C yang memenuhi persamaan &alpha;+&beta;+&gamma;=360&deg;.</p>\r\n<p>Berdasarkan persamaan tersebut, maka nilai&nbsp;<img src="images/MA181.png" alt="" width="85" height="72" /> adalah&hellip;</p>', 'tan (Î±/2)', 'cot (Î±/2)', '0', '1', '', 'JWB_A_18.', 'JWB_B_18.', 'JWB_C_18.', 'JWB_D_18.', 'JWB_E_18.png', 'D', 3),
(132, '19', 'type_a', '<p>Diketahui a dan b adalah elemen bilangan real yang memenuhi persamaan&nbsp;<img src="images/MA191.png" alt="" width="129" height="35" /></p>\r\n<p>Jika n merupakan nilai minimum dari 3a+9b, maka nilai dari n yang dimaksud adalah&hellip;</p>', '400', '300', '800', '900', '1200', 'JWB_A_19.', 'JWB_B_19.', 'JWB_C_19.', 'JWB_D_19.', 'JWB_E_19.', 'D', 4),
(133, '20', 'type_a', '<p>Rose ingin berkenalan dengan 14 teman sekelasnya yang baru jika ia dapat berkenalan dengan satu atau dua anak sekaligus, maka banyak cara Rose untuk berkenalan dengan teman sekelasnya yang baru adalah&hellip;</p>', '720', '360', '610', '210', '165', 'JWB_A_20.', 'JWB_B_20.', 'JWB_C_20.', 'JWB_D_20.', 'JWB_E_20.', 'C', 4),
(134, '21', 'type_a', '<p>Lapisan atmosfer yang merupakan tempat terjadinya fenomena iklim dan merupakan lapisan atmosfer paling tipis disebut&hellip;</p>', 'Eksosfer', 'Stratosfer', 'Mesosfer', 'Troposfer', 'Termosfer', 'JWB_A_21.', 'JWB_B_21.', 'JWB_C_21.', 'JWB_D_21.', 'JWB_E_21.', 'D', 2),
(135, '22', 'type_a', '<p>Organisme laut yang hidup di atas atau di bawah dasar laut, seperti menggali lubang ataupun menimbun diri disebut&hellip;.</p>', 'Neritik', 'Bentonik', 'Planktonik', 'Nektonik', 'Epitonik', 'JWB_A_22.', 'JWB_B_22.', 'JWB_C_22.', 'JWB_D_22.', 'JWB_E_22.', 'B', 2),
(136, '23', 'type_a', '<p>Dalam ilmu geologi, terdapat hukum-hukum dasar terkait fenomena alam. Salah satunya menjelaskan bahwa dalam kondisi belum terdeformasi, lapisan batuan bagian&nbsp; bawah memiliki umur lebih tua daripada lapisan batuan bagian atas. Pernyataan tersebut adalah bunyi dari&hellip;</p>', 'Hukum akresi lateral', 'Hukum superposisi', 'Hukum inklusi', 'Hukum initial horizontality', 'Hukum uniformitarianism', 'JWB_A_23.', 'JWB_B_23.', 'JWB_C_23.', 'JWB_D_23.', 'JWB_E_23.', 'B', 2),
(137, '24', 'type_a', '<p>Benda-benda serpihan yang berada di Tata surya yang kadang ditarik oleh gravitasi planet disebut&hellip;</p>', 'Meteor', 'Asteroid', 'Meteoroid', 'Meteorit', 'Komet', 'JWB_A_24.', 'JWB_B_24.', 'JWB_C_24.', 'JWB_D_24.', 'JWB_E_24.', 'C', 2),
(138, '25', 'type_a', '<p>Tipe pola curah hujan yang biasa terjadi di wilayah Pulau Jawa, Bali, dan Nusa Tenggara adalah&hellip;.</p>', 'Hujan Ekuatorial', 'Hujan Monsunal', 'Hujan Lokal', 'Hujan Orografis', 'Hujan Frontal', 'JWB_A_25.', 'JWB_B_25.', 'JWB_C_25.', 'JWB_D_25.', 'JWB_E_25.', 'B', 2),
(139, '26', 'type_a', '<p>Berikut merupakan ciri-ciri yang umum terdapat pada bentang alam struktural, kecuali&hellip;</p>', 'Beda tinggi yang relatif mencolok pada daerah yang sempit', 'Adanya kelurusan sungai dan membelok dengan tiba-tiba dan menyimpang', 'Sering dijumpai kelurusan lokasi mata air-mata air', 'Dijumpai sistem gawir yang lurus (pola kontur topografi yang panjang lurus)', 'Pola penyaluran yang umum dijumpai berupa radial dan multibasinal', 'JWB_A_26.', 'JWB_B_26.', 'JWB_C_26.', 'JWB_D_26.', 'JWB_E_26.', 'E', 2);
