(140, '27', 'type_a', '<p>Bila ada benda lain berukuran mirip Jupiter, berada di orbit Jupiter dan mengorbit Matahari, maka&hellip;</p>', 'Suatu saat benda tersebut dapat menabrak Jupiter, menyebabkan keduanya hancur dan membentuk benda-benda kecil seperti asteroid', 'Benda tersebut dan Jupiter tidak akan bertabrakan, dan Sistem Tata Surya tetap seperti saat ini', 'Akibat tabrakan benda tersebut dengan Jupiter akan mengubah stabilitas Sistem Tata Surya', 'Akibat tabrakan benda tersebut dengan Jupiter, mengubah orbit Jupiter mendekat ke Matahari', 'Akibat tabrakan benda tersebut dengan Jupiter, mengubah orbit Jupiter menjauh dari Matahari', 'JWB_A_27.', 'JWB_B_27.', 'JWB_C_27.', 'JWB_D_27.', 'JWB_E_27.', 'B', 3),
(141, '28', 'type_a', '<p>Nilai densitas air laut dikontrol oleh tiga variabel yang berinteraksi sangat kompleks, yaitu salinitas, temperatur, dan tekanan.</p>\r\n<p>Secara umum, densitas meningkat dengan meningkatnya&nbsp; salinitas, meningkatnya tekanan (atau kedalaman), dan turunnya temperatur.</p>\r\n<p>Densitas air laut dapat dihitung bila ketiga variabel itu dapat diketahui. Zona di mana densitas bertambah dengan cepat seiring dengan bertambahnya kedalaman disebut...</p>', 'Haloklin', 'Termoklin', 'Termohalin', 'Rhoklin', 'Piknoklin', 'JWB_A_28.', 'JWB_B_28.', 'JWB_C_28.', 'JWB_D_28.', 'JWB_E_28.', 'E', 3),
(142, '29', 'type_a', '<p>Kala yang memiliki rentang waktu sekitar 25-5 juta tahun yang lalu serta ditandai dengan munculnya Homonoid pertama adalah...</p>', 'Pliosen', 'Oligosen', 'Miosen', 'Pleistosen', 'Eosen', 'JWB_A_29.', 'JWB_B_29.', 'JWB_C_29.', 'JWB_D_29.', 'JWB_E_29.', 'C', 3),
(143, '30', 'type_a', '<p>Pada suatu hari pada tanggal 30 Desember di kota Lisbon terjadi musim dingin, sedangkan di kota Wellington pada saat waktu yang sama terjadi&hellip;</p>', 'Musim semi', 'Musim gugur', 'Musim dingin', 'Musim panas', 'Musin hujan', 'JWB_A_30.', 'JWB_B_30.', 'JWB_C_30.', 'JWB_D_30.', 'JWB_E_30.', 'D', 3),
(144, '31', 'type_a', '<p>Kita mengenal tentang arus laut, di mana arus laut dapat disebabkan karena perbedaan suhu air laut, perbedaan densitas, angin dan sebagainya. Arus yang melawati perairan Jepang yang mempunyai temperatur lebih rendah dari perairan sekitarnya disebut...</p>', 'Oyashio Current', 'Kuroshio Current', 'Arlindo Current', 'Density Current', 'Equator Current', 'JWB_A_31.', 'JWB_B_31.', 'JWB_C_31.', 'JWB_D_31.', 'JWB_E_31.', 'A', 3),
(145, '32', 'type_a', '<p>Apa yang dimaksud dengan galaksi spiral?</p>\r\n<div id="gtx-trans" style="position: absolute; left: 573px; top: -12px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', 'Debu dan gas sedikit, tersusun dari bintang-bintang tua', 'Kaya akan gas dan debu, tersusun dari bintang-bintang tua', 'Debu dan gas banyak, tersusun dari bintang-bintang tua dan muda', 'Kaya akan gas dan debu, tersusun dari bintang-bintang muda', 'Debu dan gas sedikit, tersusun dari bintang-bintang muda', 'JWB_A_32.', 'JWB_B_32.', 'JWB_C_32.', 'JWB_D_32.', 'JWB_E_32.', 'C', 3),
(146, '33', 'type_a', '<p>Perhatikan gambar di bawah ini!</p>\r\n<p><img src="images/KA13.jpg" alt="" width="188" height="225" /></p>\r\n<p>Alat ini disebut ... dan digunakan untuk mengukur &hellip;</p>', 'Pirheliometer, intensitas radiasi Matahari', 'Champbelstoke, lama penyinaran Matahari', 'Termohigrograf, temperatur dan kelembaban udara', 'Barograf, tekanan udara', 'Atmometer, penguapan', 'JWB_A_33.', 'JWB_B_33.', 'JWB_C_33.', 'JWB_D_33.', 'JWB_E_33.', 'B', 4),
(147, '34', 'type_a', '<p>Pada tanggal 29 Juli 2018 terjadi gempa bumi di Pulau Lombok yang mengakibatkan infrastruktur rusak, sehingga untuk antisipasi di masa depan, pemerintah perlu untuk membangun infrastruktur yang berkualitas, dapat diandalkan, berkelanjutan dan tahan lama sesuai dengan SGDs tujuan ke-9. Setelah diteliti, penyebab dari gempa tersebut adalah pergerakan sesar yang dipicu oleh tumbukan antara dua lempeng. Kedua lempeng tersebut adalah &hellip;</p>', 'Lempeng Indo-Australia dan lempeng Pasifik', 'Lempeng Pasifik dan lempeng Eurasia', 'Lempeng Eurasia dan lempeng Indo-Australia', 'Lempeng Indo-Australia dan lempeng Filipina', 'Lempeng Filipina dan lempeng Eurasia', 'JWB_A_34.', 'JWB_B_34.', 'JWB_C_34.', 'JWB_D_34.', 'JWB_E_34.', 'C', 4),
(148, '35', 'type_a', '<p>Perhatikan Gambar berikut!</p>\r\n<p><img src="images/KA15.jpg" alt="" width="210" height="195" /></p>\r\n<p>Alat tersebut merupakan salah satu instrumen oseanografi yang berguna untuk...</p>', 'Mengukur gelombang laut', 'Mengukur arus laut', 'Mengukur pasang surut', 'Mengukur salinitas air laut', 'Mengukur kedalaman air laut', 'JWB_A_35.', 'JWB_B_35.', 'JWB_C_35.', 'JWB_D_35.', 'JWB_E_35.', 'E', 4),
(149, '36', 'type_a', '<p>Magnitudo mutlak sebuah bintang adalah M=5 dan magnitudo semunya adalah m=10. Jika absorpsi oleh materi antar bintang diabaikan, berapakah jarak antara bintang tersebut?</p>', '150 pc (parsek)', '100 pc (parsek)', '80 pc (parsek)', '50 pc (parsek)', '120 pc (parsek)', 'JWB_A_36.', 'JWB_B_36.', 'JWB_C_36.', 'JWB_D_36.', 'JWB_E_36.', 'B', 4),
(150, '37', 'type_a', '<p>Perhatikan gambar di bawah!</p>\r\n<p><img src="images/KA17.jpg" alt="" width="305" height="249" /></p>\r\n<p>Jenis awan yang menyerupai bentuk UFO dan biasanya terdapat di atas gunung seperti pada gambar di samping adalah awan&hellip;</p>', 'Altocumulus Undulatus', 'Altocumulus Lentikularis', 'Altocumulus Stratiform', 'Altocumulus Castellanus', 'Altocumulus Humilis', 'JWB_A_37.', 'JWB_B_37.', 'JWB_C_37.', 'JWB_D_37.', 'JWB_E_37.', 'B', 4),
(151, '38', 'type_a', '<p>Teori gelombang yang menyatakan bahwa gaya gesek angin dengan permukaan air laut yang akan membangkitkan gelombang dibuat pertama kali oleh Admiral Sir Francis Beaufort (1808) yang kemudian dikenal sebagai skala angin Beaufort.</p>\r\n<p>Pernyataan kondisi angin yang terdapat di bawah ini yang paling benar adalah&hellip;..</p>', 'Angin fresh breeze, mempunyai ciri kecepatan angin 11  -  16  knot atau 5,5  -  7,9 m/dt', 'Angin fresh breeze, mempunyai ciri kecepatan angin 4 - 6 knot atau 1,6 - 3,3 m/dt', 'Angin fresh breeze, mempunyai ciri kecepatan angin  7  -  10 knot atau  3,4  -  5,4 m/dt', 'Angin fresh breeze, mempunyai ciri kecepatan angin 17 - 21 knot atau 8,0 - 10,7 m/dt', 'Angin fresh breeze, mempunyai ciri kecepatan angin 11  -  16 knot atau  5,5  -  7,9 m/dt', 'JWB_A_38.', 'JWB_B_38.', 'JWB_C_38.', 'JWB_D_38.', 'JWB_E_38.', 'D', 4),
(152, '39', 'type_a', '<p>Salah satu komponen penting pembentuk mineral seperti emas dan tembaga di Papua adalah intrusi batuan beku.</p>\r\n<p>Intrusi tersebut&nbsp; merupakan&nbsp; batuan&nbsp; beku&nbsp; dalam plutonik,&nbsp; bertekstur&nbsp; fanerik,&nbsp; mineralnya berbutir&nbsp; kasar&nbsp; hingga sedang,&nbsp; warnanya&nbsp; agak&nbsp; gelap,&nbsp; kandungan plagioklasnya&nbsp; melebihi&nbsp; ortoklas, dan tidak&nbsp; mengandung&nbsp; kuarsa,&nbsp; seperti&nbsp; pada&nbsp; gambar&nbsp; berikut</p>\r\n<p><img src="images/KA19.jpg" alt="" width="229" height="176" /></p>\r\n<p>Batuan tersebut&nbsp; adalah ..</p>', 'Diorit', 'Granit', 'Andesit', 'Gabro', 'Riolit', 'JWB_A_39.', 'JWB_B_39.', 'JWB_C_39.', 'JWB_D_39.', 'JWB_E_39.', 'A', 4),
(153, '40', 'type_a', '<p>Berapakah gaya Coriolis yang terjadi di sebuah kota yang terletak di lintang 30&deg; LU menggunakan Rumus Gaya Coriolis dengan &omega; adalah Kecepatan sudut bumi&nbsp;<img src="images/KA20.png" alt="" width="142" height="26" />&nbsp; dan kecepatan angin 20 m/s dan ke mana pembelokannya&hellip;</p>', '', '', '', '', '', 'JWB_A_40.png', 'JWB_B_40.png', 'JWB_C_40.png', 'JWB_D_40.png', 'JWB_E_40.png', 'E', 4),
