(160, '47', 'type_a', '<p>Pengukuran <strong>kadaster</strong> yang mengukur luas persil menggunakan metode rangkaian segitiga, maka data yang akan diambil dalam formulir pengukuran antara lain adalah&hellip;</p>\r\n<div id="gtx-trans" style="position: absolute; left: 89px; top: -12px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', 'Ketinggian permukaan tanah', 'Sudut', 'Koordinat', 'Jarak', 'Beda tinggi', 'JWB_A_47.', 'JWB_B_47.', 'JWB_C_47.', 'JWB_D_47.', 'JWB_E_47.', 'D', 3),
(161, '48', 'type_a', '<p><img src="images/DA8.jpg" alt="" width="274" height="174" /></p>\r\n<p>Dari proses pengindraan jauh di atas mengapa pada bagian awan mengalami pemantulan dan hamburan?</p>', 'Sumber energi terhalang', 'Akumulasi tenaga', 'Mengatur keseimbangan', 'Pemantulan objek', 'Menyinari objek', 'JWB_A_48.', 'JWB_B_48.', 'JWB_C_48.', 'JWB_D_48.', 'JWB_E_48.', 'A', 3),
(162, '49', 'type_a', '<p>Pekerjaan memetakan topografi dasar laut untuk digunakan lebih lanjut dalam navigasi kapal, konstruksi lepas pantai atau manajemen sumber daya laut adalah survei&hellip;&hellip;</p>', 'Barometri', 'Topografi', 'Tachimetri', 'Hidrografi', 'Hidrologi', 'JWB_A_49.', 'JWB_B_49.', 'JWB_C_49.', 'JWB_D_49.', 'JWB_E_49.', 'D', 3),
(163, '50', 'type_a', '<p>Terdapat manfaat dari <strong>Sistem Informasi Geospasial (SIG)</strong> salah satunya dalam bidang pengawasan daerah bencana alam, yang bukan termasuk manfaat yang dimiliki <strong>Sistem Informasi Geospasial (SIG)</strong> pada bidang ini adalah&hellip;</p>', 'Menentukan tingkat bahaya erosi', 'Memprediksi ketinggian banjir', 'Menyusun rencana-rencana pembangunan ulang daerah berdampak', 'Mengetahui area persebaran lahan pertanian dan perkebunan', 'Memprediksi tingkat kekeringan', 'JWB_A_50.', 'JWB_B_50.', 'JWB_C_50.', 'JWB_D_50.', 'JWB_E_50.', 'D', 3),
