(166, '53', 'type_a', '<p>Berikut ini yang tepat dari tahapan reduksi jarak adalah...</p>', 'Fisik bumi â€“ Ellipsoid â€“ Geoid â€“ Proyeksi', 'Fisik bumi â€“ Geoid â€“ Proyeksi â€“ Ellipsoid', 'Fisik bumi â€“ Geoid â€“ Ellipsoid â€“ Proyeksi', 'Fisik bumi â€“ proyeksi â€“ Ellipsoid â€“ Geoid', 'Fisik bumi â€“ Ellipsoid â€“ Proyeksi â€“ Geoid', 'JWB_A_53.', 'JWB_B_53.', 'JWB_C_53.', 'JWB_D_53.', 'JWB_E_53.', 'C', 4),
(167, '54', 'type_a', '<p><img src="images/DA14.png" alt="" width="278" height="173" /></p>\r\n<p>Diketahui polygon tertutup dengan sudut azimuth 160Ëš</p>\r\n<p>Jika</p>\r\n<p>&beta;1 adalah 80Ëš10&rsquo;20&rdquo;</p>\r\n<p>&beta;2 adalah 60Ëš15&rsquo;30&rdquo;</p>\r\n<p>&beta;3 adalah 39Ëš34&rsquo;01&rdquo;</p>\r\n<p>Koordinat titik A (-5,10)</p>\r\n<p>Tentukan nilai koordinat di titik B&hellip;.</p>', '13,41329 ; -50,66999', '13,51833 ; 50,669993', '13,61553 ; -50,77488', '12,61553 ; -50,66999', '12,41329 ; 50,669993', 'JWB_A_54.', 'JWB_B_54.', 'JWB_C_54.', 'JWB_D_54.', 'JWB_E_54.', 'A', 4),
(168, '55', 'type_a', '<p>Berikut ini merupakan tahapan pengukuran waterpas setelah tripod/statif sudah berdiri di atas patok</p>\r\n<p>A. Putar kedua sekrup tersebut hingga gelembung nivo berada di tengah</p>\r\n<p>B. Sejajarkan teropong dengan dua sekrup penyetel pada tribrach</p>\r\n<p>C. Putar teropong hingga tegak lurus dengan dua sekrup penyetel sebelumnya</p>\r\n<p>D. Pasang pesawat di atas kepala statif dengan mengikat landasan pesawat dan sekrup pengunci di kepala statif</p>\r\n<p>E.&nbsp;<span lang="EN-US" style="text-indent: -18pt;">Periksa Kembali dengan memutar teropong </span><span lang="EN-US" style="text-indent: -18pt;">ke segala arah, jika gelembung nivo tidak berubah, maka alat siap digunakan</span></p>\r\n<p><span lang="EN-US" style="text-indent: -18pt;">F. Putar satu sekrup tersisa hingga gelembung nivo tepat berada di tengah-tengah lingkaran nivo</span></p>\r\n<p><span lang="EN-US" style="text-indent: -18pt;">Bagaimana susunan pengaturan alat waterpas yang tepat jika tripod/statif berdiri di atas BM (Bench Mark)?</span></p>\r\n<p class="MsoNormal" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes; margin: 0cm 0cm 0cm 39.3pt;">&nbsp;</p>', 'D - C - B - A - F - E', 'D - B - C - F - A - E', 'D - B - A - C - F - E', 'D - A - C - F - B - E', 'D - C - A - B - F - E', 'JWB_A_55.', 'JWB_B_55.', 'JWB_C_55.', 'JWB_D_55.', 'JWB_E_55.', 'C', 4),
(169, '56', 'type_a', '<p>Alat ukur yang telah lama digunakan tetapi alat tersebut tidak dilakukan kalibrasi dapat menimbulkan kesalahan...</p>', 'Kecil', 'Sistematik', 'Besar', 'Acak', 'Teknik', 'JWB_A_56.', 'JWB_B_56.', 'JWB_C_56.', 'JWB_D_56.', 'JWB_E_56.', 'B', 4),
(170, '57', 'type_a', '<p>Pada peta topografi dengan interval kontur 30 meter, tergambar 2 bukit dengan jarak antar puncaknya 25cm. Jarak sebenarnya dua puncak tersebut adalah&hellip;</p>', '15 km', '10 km', '18 km', '25 km', '30 km', 'JWB_A_57.', 'JWB_B_57.', 'JWB_C_57.', 'JWB_D_57.', 'JWB_E_57.', 'A', 4),
(171, '58', 'type_a', '<p>Citra foto yang dibuat dengan menggunakan semua spektrum sinar tampak, mulai dari warna merah sampai warna ungu dinamakan citra&hellip;</p>', 'Oblique', 'Orthochromatic', 'Panchromatic', 'Multispektral', 'Inframerah', 'JWB_A_58.', 'JWB_B_58.', 'JWB_C_58.', 'JWB_D_58.', 'JWB_E_58.', 'C', 4),
(172, '59', 'type_a', '<p><img src="images/DA19.png" alt="" width="324" height="320" /></p>\r\n<p>Perhatikan gambar peta kontur di atas!&nbsp;</p>\r\n<p>Berapa skala peta yang digunakan pada gambar di atas&hellip;</p>\r\n<p>&nbsp;</p>', '1 : 1.000', '1 : 100.000', '1 : 1.000.000', '1 : 2.000.000', '1 : 500.000', 'JWB_A_59.', 'JWB_B_59.', 'JWB_C_59.', 'JWB_D_59.', 'JWB_E_59.', 'D', 4),
(173, '60', 'type_a', '<p><img src="images/DA20.png" alt="" width="260" height="134" /></p>\r\n<p>Berapa beda tinggi antara titik A dan titik B&hellip;</p>', '1,478 meter', '1,784 meter', '-1,784 meter', '-1,478 meter', '1,581 meter', 'JWB_A_60.', 'JWB_B_60.', 'JWB_C_60.', 'JWB_D_60.', 'JWB_E_60.', 'A', 4),
(174, '61', 'type_a', '<p>Balik P seberat 100 N diikat dengan tali mendatar pada tembok. Balok Q yang memiliki berat 500 N ditarik dengan gaya luar F. Jika koefisien gesek antara kedua balok = 0,2 dan koefisien gesek antara balok Q dengan meja = 0,5. Berapa F minimum agar balok Q dapat ditarik?</p>', '100 N', '320 N', '600 N', '750 N', '950 N', 'JWB_A_61.', 'JWB_B_61.', 'JWB_C_61.', 'JWB_D_61.', 'JWB_E_61.', 'B', 4),
(175, '62', 'type_a', '<p>Sebuah massa dihubungkan pada pegas A, sedangkan sebuah massa yang dihubungkan pada pegas B tiga kali massa pada pegas A. Jika konstanta pegas A 12 kali pegas B, perbandingan frekuensi getar pegas B terhadap A adalah...</p>', '1/6', '1/2', '2', '6', '8', 'JWB_A_62.', 'JWB_B_62.', 'JWB_C_62.', 'JWB_D_62.', 'JWB_E_62.', 'A', 3),
(177, '63', 'type_a', '<p>Apabila sebuah balok dengan massa 3 kg diberi gaya sebesar&nbsp;<img src="images/FA3.png" alt="" width="60" height="32" /> yang membentuk sudut 45&deg; terhadap lantai kasar bergerak dengan percepatan&nbsp;<img src="images/FA31.png" alt="" width="64" height="21" /> . Berapa koefisien gesekan balok dengan lantai?</p>', '0,27', '0,37', '0,47', '0,57', '0,67', 'JWB_A_63.', 'JWB_B_63.', 'JWB_C_63.', 'JWB_D_63.', 'JWB_E_63.', 'C', 4),
(178, '64', 'type_a', '<p>Balok kayu 4 kg diam di lantai datar kasar yang memiliki koefisien gesek 0,3.</p>\r\n<p>Balok lalu ditarik dengan gaya sebesar 20 N selama 3 detik.</p>\r\n<p>Jarak total yang ditempuh balok dari penarikan sampai berhenti adalah... m</p>', '45', '32', '27', '15', '5', 'JWB_A_64.', 'JWB_B_64.', 'JWB_C_64.', 'JWB_D_64.', 'JWB_E_64.', 'D', 4),
(179, '65', 'type_a', '<p>Sebuah balok bermassa M = 750 gram diam pada suatu permukaan meja licin. Balok tersebut kemudian dihubungkan dengan balok lain dengan massa 100 gram yang bergantung dan menyentuh samping meja yang kasar melalui seutas tali dan sebuah katrol ringan licin. Meja kemudian bergerak horizontal dengan percepatan <img src="images/FA5.png" alt="" width="78" height="23" />.&nbsp;</p>\r\n<p>Berapakah koefisien gesek antara balok m dengan pinggiran meja agar M dan m tidak bergerak relatif terhadap meja?</p>', '0,5', '0,4', '0,3', '0,2', '0,1', 'JWB_A_65.', 'JWB_B_65.', 'JWB_C_65.', 'JWB_D_65.', 'JWB_E_65.', 'B', 4),
(180, '66', 'type_a', '<p>Pada gambar berikut diberikan diameter piston kecil 10 cm dan diameter piston besar adalah 1m.</p>\r\n<p><img src="images/FA6.png" alt="" width="265" height="177" /></p>\r\n<p>Besar gaya f untuk menyeimbangkan sistem dengan gaya F sebesar 5000 N adalah...</p>', '100 N', '50 N', '40 N', '25 N', '20 N', 'JWB_A_66.', 'JWB_B_66.', 'JWB_C_66.', 'JWB_D_66.', 'JWB_E_66.', 'B', 2),
(181, '67', 'type_a', '<p><img src="images/FA7.png" alt="" width="168" height="147" /></p>\r\n<p>Kotak bermassa m kg ditekan menghadap dinding dengan gaya konstan F. Jika koefisien gesek statis dan kinetik antara balok dengan dinding masing-masing adalah &mu;k dan &mu;s maka untuk kasus balok tepat akan meluncur jatuh, hubungan berikut yang benar adalah...</p>', '', '', '', '', '', 'JWB_A_67.', 'JWB_B_67.', 'JWB_C_67.', 'JWB_D_67.', 'JWB_E_67.', 'B', 4),
(182, '68', 'type_a', '<p>Suatu benda dengan massa 1 kg dilempar vertikal ke atas dari permukaan tanah. Pada suatu ketinggian tertentu benda tersebut memiliki energi potensial 24 Joule dan memiliki kecepatan 4 m/s.</p>\r\n<p>Kecepatan benda saat kembali mencapai permukaan tanah adalah...</p>\r\n<p>*abaikan gesekan oleh udara</p>', '12 m/s', '8 m/s', '6 m/s', '4 m/s', '10 m/s', 'JWB_A_68.', 'JWB_B_68.', 'JWB_C_68.', 'JWB_D_68.', 'JWB_E_68.', 'B', 2),
(183, '69', 'type_a', '<p><img src="images/FA9.png" alt="" width="260" height="229" /></p>\r\n<p>Jika sistem di atas setimbang dengan sudut &theta; = 37&deg; dan m = 6 kg.</p>\r\n<p>Maka besar tegangan tiap tali adalah...</p>\r\n<p>*anggap tali tak bermassa</p>\r\n<p>*asumsi sin &theta; = 0,6</p>', '80 N dan 100 N', '75 N dan 45 N', '100 N dan 200 N', '120 N dan 75 N', '100 N dan 45 N', 'JWB_A_69.', 'JWB_B_69.', 'JWB_C_69.', 'JWB_D_69.', 'JWB_E_69.', 'A', 2),
(184, '70', 'type_a', '<p><img src="images/FA10.png" alt="" width="277" height="209" /></p>\r\n<p>Diberikan mA = 10 kg dan mB = 5kg.</p>\r\n<p>Jika sistem di atas bergerak dengan percepatan 4/3 m/s.</p>\r\n<p>Maka koefisien gesekan kinetik antara balok dengan meja adalah...</p>', '0,3', '0,4', '0,5', '0,6', '0,7', 'JWB_A_70.', 'JWB_B_70.', 'JWB_C_70.', 'JWB_D_70.', 'JWB_E_70.', 'A', 4),
(185, '71', 'type_a', '<p>Seseorang mampu mengangkat benda&nbsp;<img src="images/FA11.png" alt="" width="186" height="27" />&nbsp;dengan beban maksimum 40 kg di udara.</p>\r\n<p>Jika orang tersebut berada di dalam air, maka orang tersebut dapat mengangkat benda tersebut maksimum sebesar...</p>', '50 kg', '65 kg', '80 kg', '95 kg', '105 kg', 'JWB_A_71.', 'JWB_B_71.', 'JWB_C_71.', 'JWB_D_71.', 'JWB_E_71.', 'B', 3),
(186, '72', 'type_a', '<p>Sebuah bintang yang temperaturnya 6000 K, akan memancarkan spektrum benda hitam dengan panjang gelombangnya berpuncak pada&hellip;</p>', '6.000 m', '0,0000005 nm', '18 nm', '0,0000005 m', '0,00000018 nm', 'JWB_A_72.', 'JWB_B_72.', 'JWB_C_72.', 'JWB_D_72.', 'JWB_E_72.', 'D', 2),
(187, '73', 'type_a', '<p>Pernyataan berikut yang salah adalah...</p>', 'Energi sinar ultraviolet lebih besar dari gelombang radio', 'Panjang gelombang sinar gamma lebih pendek dari sinar X', 'Frekuensi sinar tampak kuning lebih kecil dari sinar tampak merah', 'Panjang gelombang sinar tampak biru lebih pendek dari sinar hijau', 'Energi sinar gamma lebih besar dari energi sinar ultraviolet', 'JWB_A_73.', 'JWB_B_73.', 'JWB_C_73.', 'JWB_D_73.', 'JWB_E_73.', 'C', 2),
(188, '74', 'type_a', '<p>Seorang penderita hipermetropia memakai lensa kekuatan 4/3 dioptri.</p>\r\n<p>Jika orang tersebut ingin membaca pada jarak 30 cm, titik dekat orang tersebut adalah...</p>', '20 cm', '30 cm', '40 cm', '50 cm', '75 cm', 'JWB_A_74.', 'JWB_B_74.', 'JWB_C_74.', 'JWB_D_74.', 'JWB_E_74.', 'D', 3),
(189, '75', 'type_a', '<p>Amatilah diagram pembentuk bayangan berikut.</p>\r\n<p><img src="images/F_75a_1.png" alt="" width="256" height="86" /></p>\r\n<p>Jika berkas sinar yang keluar dari lensa okuler merupakan berkas sejajar, dan mata yang mengamati berpenglihatan normal, maka perbesaran mikroskop adalah &hellip;. (Sn = 25 cm)</p>', '20 kali', '30 kali', '40 kali', '50 kali', '25 kali', 'JWB_A_75.', 'JWB_B_75.', 'JWB_C_75.', 'JWB_D_75.', 'JWB_E_75.', 'D', 3),
(190, '76', 'type_a', '<p>Tingkat terang sebuah bintang yang dilihat oleh pengamat di bumi disebut&hellip;</p>', 'Luminositas Bintang', 'Magnitudo Semu', 'Magnitudo Mutlak', 'Magnitudo Sebenarnya', 'Amplitudo', 'JWB_A_76.', 'JWB_B_76.', 'JWB_C_76.', 'JWB_D_76.', 'JWB_E_76.', 'B', 2),
(191, '77', 'type_a', '<p>Sebuah planet 3 kali massa bumi dan diameternya 2 kali diameter bumi.</p>\r\n<p>Jika kuat medan gravitasi di permukaan bumi sebesar g, maka berapa kuat medan gravitasi di permukaan planet itu?</p>', '3/4 g', '3/2 g', '1 g', '4/3 g', '4 g', 'JWB_A_77.', 'JWB_B_77.', 'JWB_C_77.', 'JWB_D_77.', 'JWB_E_77.', 'A', 3),
(192, '78', 'type_a', '<p>Besar medan gravitasi di permukaan suatu planet adalah dua kali di permukaan bumi.</p>\r\n<p>Jika massa planet tersebut 1/8 massa bumi, maka jari-jari bumi ... kali terhadap jari-jari planet tersebut.</p>', '4', '3', '2', '1/2', '1/4', 'JWB_A_78.', 'JWB_B_78.', 'JWB_C_78.', 'JWB_D_78.', 'JWB_E_78.', 'A', 3),
(193, '79', 'type_a', '<p>Ahmad dan Budi berada di sebuah kereta api yang bergerak, sedangkan Candra diam di sebuah stasiun.</p>\r\n<p>Ahmad sedang makan sepiring nasi goreng. Dengan memperhatikan pengaruh relativitas khusus, manakah dari pernyataan berikut yang benar?</p>', 'Selang waktu yang diperlukan Ahmad untuk menghabiskan nasi goreng menurut Budi dan Candra sama', 'Menurut Budi, Ahmad menghabiskan nasi goreng dalam selang waktu yang lebih panjang dibandingkan menurut Candra', 'Jarak antara baris kursi di kereta api menurut Ahmad, Budi, dan Candra sama', 'Jarak antar baris kursi di kereta api menurut Ahmad dan Budi lebih pendek', 'Menurut Budi, Ahmad menghabiskan nasi goreng dalam selang waktu yang lebih singkat dibandingkan menurut Candra', 'JWB_A_79.', 'JWB_B_79.', 'JWB_C_79.', 'JWB_D_79.', 'JWB_E_79.', 'E', 4),
(194, '80', 'type_a', '<p>Planet jupiter memiliki jarak orbit ke matahari yang diperkirakan sama dengan empat kali jarak orbit bumi ke matahari. Periode revolusi bumi mengelilingi matahari 1 tahun. Berapakah periode jupiter tersebut mengelilingi matahari?</p>', '5 Tahun', '8 Tahun', '4 Tahun', '9 Tahun', '10 Tahun', 'JWB_A_80.', 'JWB_B_80.', 'JWB_C_80.', 'JWB_D_80.', 'JWB_E_80.', 'B', 4),
(198, '81', 'type_a', '<p>Penambangan di Indonesia mayoritas menggunakan metode open pit mining. Undang-undang No. 4 Tahun 2009 tentang Pertambangan Mineral dan Batubara mewajibkan perusahaan pertambangan untuk melakukan reklamasi dan kegiatan pasca tambang atas areal tambang yang diusahakannya. Namun, ada perusahaan yang tidak melakukan reklamasi pasca tambang, alasannya karena&hellip;</p>', 'Biaya tambahan untuk mengurangi degradasi lahan pada daerah sepi penduduk kurang bermanfaat', 'Lahan bekas tambang dapat dijadikan sebagai lokasi wisata alam dengan potensi profit tinggi', 'Lahan bekas tambang dapat dijadikan sebagai tambak ikan karena mengandung unsur hara rendah', 'Kandungan pH pada air yang stabil sehingga sangat baik digunakan untuk pengairan lahan pertanian', 'Tidak ada jawaban yang benar', 'JWB_A_81.', 'JWB_B_81.', 'JWB_C_81.', 'JWB_D_81.', 'JWB_E_81.', 'A', 4),
(199, '82', 'type_a', '<p>Penelitian pada tahun 2011 menunjukkan korelasi <em>urban heat island effect</em> di Jakarta dengan beberapa faktor. Di bawah ini yang termasuk faktor penyebab terjadinya kondisi tersebut adalah...</p>', 'Greenhouse gases di urban area Jakarta meningkat', 'Pemakaian energi listrik yang bertambah 80% guna mengatur suhu lingkungan', 'Peningkatan temperatur perkotaan', 'Meningkatnya kepadatan penduduk', 'Kondisi lingkungan Jakarta yang semakin padat', 'JWB_A_82.', 'JWB_B_82.', 'JWB_C_82.', 'JWB_D_82.', 'JWB_E_82.', 'D', 4),
(200, '83', 'type_a', '<p>Pukul 13.00 di Area Gedung Teknik Geomatika ITS, terukur cuaca cerah dengan temperature 35&deg;C dengan setiap 1m<span style="background-color: #ffffff; color: #111111; font-family: Roboto, sans-serif; font-size: 18px;">&sup3;</span>&nbsp;udara mengandung uap air sebanyak 23,5 gram. Jika pada suhu maksimum yang sama dengan konsentrasi air maksimumnya adalah 27,3 gram, maka kelembaban udara relative Area Gedung Teknik Geomatika ITS adalah&hellip;</p>', '86,0805%', '128,2025%', '67,8701%', '68,54%', '66,041%', 'JWB_A_83.', 'JWB_B_83.', 'JWB_C_83.', 'JWB_D_83.', 'JWB_E_83.', 'A', 4),
(201, '84', 'type_a', '<p>Guna menunjang aktivitas mahasiswa ITS, dibangun jalan Teknik Sipil, Teknik Perkapalan, Teknik Geomatika, dan Teknik Mesin Industri. Jalan-jalan tersebut ditujukan guna menghubungkan Departemen Teknik Geomatika, Departemen Teknik Komputer, Departemen Teknik Sistem Perkapalan, Departemen Teknik Lingkungan, dan Departemen Fisika. Tingkat interaksi wilayah Kampus ITS adalah&hellip;</p>', '0,8', '0,7', '0,6', '1', '0,75', 'JWB_A_84.', 'JWB_B_84.', 'JWB_C_84.', 'JWB_D_84.', 'JWB_E_84.', 'A', 2),
(202, '85', 'type_a', '<p><img src="images/G_1pengembangan wilayah.png" alt="" width="459" height="258" /></p>\r\n<p>Perkembangan wilayah pada gambar cenderung menuju pusat pendidikan (ITS). Faktor apa yang menyebabkan kecenderungan wilayah terjadi seperti pada gambar?</p>', 'Bisnis rumah kos yang menguntungkan', 'Daerah ITS berada pada Kecamatan Sukolilo yang memiliki topografi datar', 'Mudahnya transportasi akibat pembangunan yang masif di area tersebut', 'Banyaknya mahasiswa menyebabkan bisnis retail meningkat', 'Berdekatan dengan Pantai Kenjeran yang merupakan daya tarik wisata Surabaya', 'JWB_A_85.', 'JWB_B_85.', 'JWB_C_85.', 'JWB_D_85.', 'JWB_E_85.', 'A', 3),
(203, '86', 'type_a', '<p>Interaksi antarwilayah pada Surabaya dan Mojokerto dapat ditingkatkan karena kedua wilayah dapat saling melengkapi kebutuhannya. Adapun bentuk interaksi yang saling melengkapi apabila wilayah-wilayah...</p>', 'Memiliki potensi keunggulan yang berbeda-beda', 'Mengembangkan program interaksi antarwilayah karena kedua wilayah saling berdekatan', 'Memiliki kelebihan dan kekurangan yang dapat dipenuhi oleh suatu wilayah dengan wilayah lainnya', 'Mengembangkan bentuk komunikasi untuk berinteraksi antarwilayah memanfaatkan pembangunan infrastruktur yang baik', 'Tidak ada jawaban yang benar', 'JWB_A_86.', 'JWB_B_86.', 'JWB_C_86.', 'JWB_D_86.', 'JWB_E_86.', 'C', 4),
(204, '87', 'type_a', '<p>Seorang mahasiswa Teknik Geomatika ITS melakukan survey lapangan yang menghasilkan beberapa variabel hingga menemukan bahwa wilayah tersebut rentan terhadap banjir. Karakteristik wilayah seperti apa yang menyebabkan mahasiswa Teknik Geomatika ITS dapat menyimpulkan bahwa wilayah tersebut rentan banjir?</p>', 'Dataran endapan sungai yang kemiringan tanahnya kurang dari 2 persen', 'Endapan alluvial yang permukaan tanahnya landai', 'Daerah pegunungan dengan aliran limpasan lambat', 'Bukit dataran tinggi sebagai hulu sungai', 'Endapan vulkanik dengan curah hujan tinggi', 'JWB_A_87.', 'JWB_B_87.', 'JWB_C_87.', 'JWB_D_87.', 'JWB_E_87.', 'A', 3),
(205, '88', 'type_a', '<p>Sebuah industri rumah tangga olahan ikan di Surabaya biasa mendapatkan stok ikan dari nelayan Pantai Kenjeran serta menjualnya ke Pasar Manyar. Industri tersebut membutuhkan bahan baku 3,78 ton per harinya dengan hasil olahan jadinya mencapai 4016 kg. Di mana sebaiknya lokasi industri dibangun?</p>', 'Di dekat Pantai Kenjeran', 'Di dekat Pasar Manyar', 'Di tengah antara Pantai Kenjeran dan Pantai Manyar', 'Berada di Pantai Kenjeran', 'Berada di Pasar Manyar', 'JWB_A_88.', 'JWB_B_88.', 'JWB_C_88.', 'JWB_D_88.', 'JWB_E_88.', 'B', 4),
(206, '89', 'type_a', '<p>Penduduk provinsi Jawa Timur pada tahun 2021 sebanyak&nbsp; 39,74 juta terdapat kelahiran 600 ribu bayi. Pada Wanita kelompok umur 21-26 dengan jumlah 150 ribu jiwa, terjadi kelahiran sebanyak 23 ribu bayi. Berdasarkan data tersebut, angka kelahiran kelompok umur wanita adalah&hellip;</p>\r\n<div id="gtx-trans" style="position: absolute; left: -118px; top: -12px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', '153,5', '148,8', '137,76', '149,76', '151,6', 'JWB_A_89.', 'JWB_B_89.', 'JWB_C_89.', 'JWB_D_89.', 'JWB_E_89.', 'A', 4),
(207, '90', 'type_a', '<p>Gunung Bromo merupakan salah satu gunung aktif di Provinsi Jawa Timur.</p>\r\n<p>Suatu Ketika muncul ciri-ciri sebagai berikut:</p>\r\n<p>(1) adanya peningkatan intensif kegiatan seismik</p>\r\n<p>(2) aktivitas gunung api dapat berlanjut</p>\r\n<p>(3) jika aktivitas seismik meningkat, letusan dapat terjadi dalam waktu 2 pekan</p>\r\n<p>Berdasarkan ciri-ciri tersebut, maka aktivitas gunung api menunjukkan status...</p>', 'Normal', 'Awas', 'Siaga', 'Waspada I', 'Waspada II', 'JWB_A_90.', 'JWB_B_90.', 'JWB_C_90.', 'JWB_D_90.', 'JWB_E_90.', 'C', 2),
(208, '91', 'type_a', '<p>Mitigasi bencana dapat dilakukan dengan cara mengurangi <em>vulnerability</em> penduduk dan pemerintah. Cara untuk mengurangi vulnerability terlihat pada tindakan berikut, <em>kecuali</em>...</p>', 'Tidak mendirikan pemukiman di lereng yang curam', 'Tidak mengikuti rambu petunjuk evakuasi', 'Tidak mendirikan bangunan di sempadan sungai', 'Tidak membuang sampah ke sungai', 'Tidak menyalahi aturan perizinan lokasi dan prinsip', 'JWB_A_91.', 'JWB_B_91.', 'JWB_C_91.', 'JWB_D_91.', 'JWB_E_91.', 'B', 2),
(209, '92', 'type_a', '<p><em><strong>Blue carbon</strong></em> merupakan scenario efektif dalam pengurangan emisi dunia. Indonesia sebagai negara kepulauan terbesar memiliki potensi tinggi dalam pemanfaatan blue carbon. Namun pemanfaatannya hingga kini belum optimal, Adapun kendala tersebut adalah&hellip;</p>', 'Adanya anggapan bahwa laut bukan komponen penting dalam penurunan emisi gas rumah kaca', 'Penelitian mengenai efektivitas bakau dan padang lamun di Indonesia masih minim', 'Pendataan kawasan potensi blue carbon belum menyeluruh, menyulitkan analisis hasil', 'Green carbon telah cukup dalam mengurangi emisi dunia hingga beberapa tahun ke depan', 'Tidak ada jawaban yang benar', 'JWB_A_92.', 'JWB_B_92.', 'JWB_C_92.', 'JWB_D_92.', 'JWB_E_92.', 'A', 3),
(210, '93', 'type_a', '<p>Indonesia merupakan negara dengan potensi pemanfaatan garis pantai tinggi, termasuk pada produksi garam. Namun, dengan salinitas air laut Indonesia yang rendah menyebabkan produksi garam nasional rendah. Penyebab rendahnya salinitas air laut Indonesia adalah&hellip;</p>', 'Curah hujan tinggi dan kondisi laut terbuka', 'Pasang surut rendah dan kelembapan udara tinggi', 'Musim kemarau pendek dan diapit dua Samudra', 'Curah hujan tinggi dan berupa negara kepulauan', 'Kadar mineral air sungai rendah dan laut dangkal', 'JWB_A_93.', 'JWB_B_93.', 'JWB_C_93.', 'JWB_D_93.', 'JWB_E_93.', 'A', 3),
(211, '94', 'type_a', '<p>Pencurian ikan setahun ke belakang mengalami peningkatan setelah adanya moratorium pengeboman kapal asing pencuri ikan. Banyaknya ikan yang dicuri nelayan asing karena&hellip;</p>', 'Wilayah laut sangat terbuka', 'Sebagian besar laut dangkal', 'Wilayah laut sangat luas', 'Garis bayas wilayah tidak jelas', 'Wilayah laut yang banyak pulau', 'JWB_A_94.', 'JWB_B_94.', 'JWB_C_94.', 'JWB_D_94.', 'JWB_E_94.', 'D', 2),
(212, '95', 'type_a', '<p>Saat akan melakukan pengambilan kenampakan permukaan bumi pada siang hari dengan sistem pengindraan jauh pasif, gambar yang dihasilkan kabur. Kondisi ini diduga akibat dari pengambilan data yang dilakukan pada saat cuaca mendung. Berdasarkan informasi tersebut, jenis hamburan yang menyebabkan hasil gambar menjadi kabur atau tidak jelas adalah&hellip;</p>', 'Hamburan umum', 'Hamburan Rayleigh', 'Hamburan mie', 'Hamburan non-selektif', 'Hamburan atmosfer', 'JWB_A_95.', 'JWB_B_95.', 'JWB_C_95.', 'JWB_D_95.', 'JWB_E_95.', 'C', 3),
(213, '96', 'type_a', '<p>Kesuburan tanah merupakan sifat lahan yang harus dipertahankan secara berkelanjutan dalam pembangunan pertanian. Namun, kenyataannya ada unsur hara yang hilang sehingga harus dilakukan upaya pencegahan melalui kegiatan-kegiatan berikut, kecuali&hellip;</p>', 'Terasering', 'Contour Farming', 'Crop Rotation', 'Contour Ploughing', 'Strips Cropping', 'JWB_A_96.', 'JWB_B_96.', 'JWB_C_96.', 'JWB_D_96.', 'JWB_E_96.', 'D', 3),
(214, '97', 'type_a', '<p>Indonesia merupakan negara yang dilewati garis khatulistiwa. Hal tersebut menyebabkan Indonesia berpotensi mengembangkan energi matahari sebagai alternatif energi. Adapun alasan dari potensi tersebut adalah&hellip;</p>', 'Selalu panas setiap hari', 'Intensitas sinar matahari tinggi', 'Lama penyinaran harian tinggi', 'Hambatan awan tidak berarti', 'Absorpsi atmosfer rendah', 'JWB_A_97.', 'JWB_B_97.', 'JWB_C_97.', 'JWB_D_97.', 'JWB_E_97.', 'B', 4),
(215, '98', 'type_a', '<p>Wilayah pesisir di Surabaya banyak dimanfaatkan penduduk sebagai pemukiman karena&hellip;</p>', 'Aksesibilitas yang tinggi', 'Kesuburan tanah tinggi', 'Ketersediaan sarana prasarana', 'Air yang melimpah', 'Topografi yang datar', 'JWB_A_98.', 'JWB_B_98.', 'JWB_C_98.', 'JWB_D_98.', 'JWB_E_98.', 'C', 2),
(216, '99', 'type_a', '<p>Langkah yang harus diambil Indonesia untuk memanfaatkan peluang dalam konteks<strong> Indonesia-Malaysia-Thailand Growth Triangle (IMT-GT)</strong> adalah..</p>', 'Menghalangi budaya negatif yang masuk Indonesia', 'Memainkan peranan utama dalam perdagangan', 'Meningkatkan kondisi infrastruktur perbatasan', 'Mengirim tenaga kerja Indonesia ke luar negeri', 'Meningkatkan hubungan diplomatic', 'JWB_A_99.', 'JWB_B_99.', 'JWB_C_99.', 'JWB_D_99.', 'JWB_E_99.', 'B', 4),
(217, '100', 'type_a', '<p>Wilayah prioritas pemasaran bahan kebutuhan pokok seperti beras dan minyak goreng adalah wilayah yang&hellip;</p>', 'Pertumbuhan ekonominya tinggi', 'Pendidikan penduduknya rendah', 'Kepadatan penduduknya tinggi', 'Tingkat migrasi penduduknya rendah', 'Pertumbuhan penduduknya tinggi', 'JWB_A_100.', 'JWB_B_100.', 'JWB_C_100.', 'JWB_D_100.', 'JWB_E_100.', 'C', 2),
(218, '1', 'type_b', '<p>Terdapat dua buah lingkaran A dan lingkaran B dengan jari-jarinya berturut-turut adalah 10 dan 6 satuan panjang dan bersinggungan di luar pada titik P. Jika Q merupakan perpotongan garis singgung persekutuan luarnya, nilai &lfloor;PQ&rfloor; dengan PQ merupakan jarak antara titik P dan Q adalah &hellip;&nbsp;</p>', '14', '30', '15', '10', '12', 'JWB_A_1.', 'JWB_B_1.', 'JWB_C_1.', 'JWB_D_1.', 'JWB_E_1.', 'B', 3),
(219, '2', 'type_b', '<p>Sebuah kertas berbentuk persegi panjang PQRS dengan PQ = 10 dan QR = 24. Jika kertas dilipat mengikuti diagonal PR dengan Q&rsquo; merupakan posisi titik Q setelah kertasnya dilipat, maka panjang Q&rsquo;S adalah &hellip;</p>', '', '', '', '', '', 'JWB_A_2.png', 'JWB_B_2.png', 'JWB_C_2.png', 'JWB_D_2.png', 'JWB_E_2.png', 'A', 3),
(220, '3', 'type_b', '<p>Perhatikan gambar berikut</p>\r\n<p><img src="images/MABC3.png" alt="" width="124" height="154" /></p>\r\n<p>Jika &ang;AOB=&alpha; dan &ang;COD=&beta;, maka &ang;AXB=â‹¯&nbsp;</p>\r\n<p>&nbsp;</p>', '(1/2) (Î±-Î²)', '2Î±+Î²', 'Î±-2Î²', '2Î±-Î²', 'Î±-Î²', 'JWB_A_3.', 'JWB_B_3.', 'JWB_C_3.', 'JWB_D_3.', 'JWB_E_3.', 'A', 2),
