(225, '8', 'type_b', '<p>Segiempat KLMN adalah sebuah trapesium dengan KNâˆ¥LM, digambarkan pada bidang koordinat kartesius. Diketahui NM tegak lurus ML, K (0,4), dan L (8,6). Titik N terletak pada sumbu ð‘¦ dan titik M terletak pada sumbu ð‘¥. Jika luas persegi dengan koordinat (0,0),(1,0), (1,1), dan (0,1) adalah 8 satuan luas, maka luas KLMN adalah.....&nbsp;</p>', '280', '180', '320', '240', '160', 'JWB_A_8.', 'JWB_B_8.', 'JWB_C_8.', 'JWB_D_8.', 'JWB_E_8.', 'D', 2),
