(228, '11', 'type_b', '<p>Diberikan belah ketupat KLMN. Titik W, X, Y, dan Z berturut-turut merupakan titik berat segitiga KLM, LMN, MNK, dan NKL. Jika perbandingan luas belah ketupat WXYZ dan KLMN dapat dinyatakan sebagai x âˆ¶ y, maka nilai x+y adalah &hellip;&nbsp;</p>', '4', '7', '13', '10', '28', 'JWB_A_11.', 'JWB_B_11.', 'JWB_C_11.', 'JWB_D_11.', 'JWB_E_11.', 'D', 4),
(229, '12', 'type_b', '<p class="MsoNormal" style="text-align: justify;">Seseorang ingin membuat suatu perumahan berbentuk lingkaran dengan pusat (0,0) dan berjari-jari 2 satuan. Jika semua rumah dalam perumahan tersebut berada pada koordinat bilangan bulat, maka banyaknya pasangan rumah berjarak lebih dari 3 satuan adalah&hellip;</p>', '5', '10', '14', '8', '7', 'JWB_A_12.', 'JWB_B_12.', 'JWB_C_12.', 'JWB_D_12.', 'JWB_E_12.', 'B', 4),
(230, '13', 'type_b', '<p>Peluang sebuah koin menunjukkan angka ketika ditos adalah (2/3). Diketahui bahwa peluang muncul tempat 2 gambar dan 4 angka ketika koin tersebut ditos 6 kali dapat dituliskan dalam bentuk (a/b) di mana a,b bilangan asli yang relatif prima. Nilai dari b - a adalah&hellip;&nbsp;</p>', '725', '733', '737', '731', '721', 'JWB_A_13.', 'JWB_B_13.', 'JWB_C_13.', 'JWB_D_13.', 'JWB_E_13.', 'A', 2),
