(234, '17', 'type_b', '<p>Titik (p,p) dirotasikan dengan pusat (0,0) sebesar 120&deg;. Kemudian direfleksikan terhadap sumbu-x. Agar Kembali ke titik (p,p), titik harus dirotasikan dengan pusat (0,0) sebesar&hellip;&nbsp;</p>', '120Â°', '150Â°', '180Â°', '210Â° ', '60Â°', 'JWB_A_17.', 'JWB_B_17.', 'JWB_C_17.', 'JWB_D_17.', 'JWB_E_17.', 'D', 3),
