(236, '19', 'type_b', '<p>Diketahui a,b adalah elemen bilangan real yang memenuhi persamaan &radic;a+&radic;b=20. Jika nilai minimum dari 3a+9b dapat ditulis dalam bentuk 100p+10q+r, maka nilai dari p+q+r adalah&hellip;&nbsp;</p>', '4', '3', '8', '9', '12', 'JWB_A_19.', 'JWB_B_19.', 'JWB_C_19.', 'JWB_D_19.', 'JWB_E_19.', 'D', 4),
(237, '20', 'type_b', '<p>Ririn ingin berkenalan dengan 14 teman sekelasnya yang baru. Pada saat berkenalan, Ririn dapat berkenalan dengan satu atau dua anak sekaligus. jika banyak cara Ririn untuk berkenalan dengan teman sekelasnya yang baru dapat ditulis sebagai 100a+10b, maka nilai dari a - b adalah&hellip;&nbsp;&nbsp;</p>', '3', '4', '5', '6', '7', 'JWB_A_20.', 'JWB_B_20.', 'JWB_C_20.', 'JWB_D_20.', 'JWB_E_20.', 'C', 4),
(238, '21', 'type_b', '<p>Benda-benda&nbsp; serpihan yang berada di Tata surya,&nbsp; kadang ditarik oleh gravitasi planet yang tidak habis terbakar dan mencapai permukaan bumi&nbsp; disebut&hellip;..</p>', 'Meteor', 'Asteroid', 'Meteoroid', 'Meteorit', 'Komet', 'JWB_A_21.', 'JWB_B_21.', 'JWB_C_21.', 'JWB_D_21.', 'JWB_E_21.', 'D', 2),
(239, '22', 'type_b', '<p>Lapisan atmosfer yang merupakan tempat adanya lapisan ozon dan mempunyai sifat udara yang kering disebut &hellip;</p>', 'Eksosfer', 'Stratosfer', 'Mesosfer', 'Troposfer', 'Termosfer', 'JWB_A_22.', 'JWB_B_22.', 'JWB_C_22.', 'JWB_D_22.', 'JWB_E_22.', 'B', 2),
(240, '23', 'type_b', '<p>Berikut merupakan ciri-ciri yang umum terdapat pada bentang alam karst, kecuali&hellip;</p>', 'Banyaknya Stalaktit dan Stalakmit akibat dari air yang masuk ke lubang-   lubang (doline) ', 'Terdapatnya sejumlah cekungan (depresi) dengan bentuk dan ukuran yang bervariasi', 'Sungai-sungai tidak mengalami perkembangan pada permukaan (terputus)', 'Terdapatnya endapan sedimen lumpur berwarna merah (terrarosa)', 'Adanya kenampakan dataran / depresi yang sempit memanjang', 'JWB_A_23.', 'JWB_B_23.', 'JWB_C_23.', 'JWB_D_23.', 'JWB_E_23.', 'E', 2),
(241, '24', 'type_b', '<p>Tipe pola curah hujan yang biasa terjadi di wilayah Pulau Maluku dan sekitarnya adalah&hellip;.</p>', 'Hujan Ekuatorial', 'Hujan Monsunal', 'Hujan Lokal', 'Hujan Orografis', 'Hujan Frontal', 'JWB_A_24.', 'JWB_B_24.', 'JWB_C_24.', 'JWB_D_24.', 'JWB_E_24.', 'C', 2),
(242, '25', 'type_b', '<p>Organisme laut yang perpindahan atau gerakannya sangat tergantung gerakan massa air laut disebut&hellip;.</p>\r\n<div id="gtx-trans" style="position: absolute; left: -81px; top: -12px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', 'Neritik', 'Bentonik', 'Planktonik', 'Nektonik', 'Epitonik', 'JWB_A_25.', 'JWB_B_25.', 'JWB_C_25.', 'JWB_D_25.', 'JWB_E_25.', 'C', 2),
(243, '26', 'type_b', '<p>Salah&nbsp; satu&nbsp; hukum&nbsp; dasar&nbsp; stratigrafi&nbsp; menyebutkan&nbsp; bahwa&nbsp; suatu&nbsp; perlapisan&nbsp; batuan&nbsp; tertentu&nbsp; dapat dibedakan dari perlapisan yang lain atas dasar ciri tertentu dari kandungan fosilnya, hukum tersebut adalah ...</p>', 'Uniformitarianism', 'Lateral accretion  ', 'Biotic succession ', 'Superposition', 'Strata identified by fossil', 'JWB_A_26.', 'JWB_B_26.', 'JWB_C_26.', 'JWB_D_26.', 'JWB_E_26.', 'E', 2),
(244, '27', 'type_b', '<p>Grafik perbandingan antara temperatur air laut dengan kedalaman akan menunjukkan bahwa suhu permukaan tinggi semakin ke perairan dalam suhunya semakin rendah dan tetap rendah sampai ke perairan paling dalam. Fenomena perubahan suhu tinggi dan tetap rendah tersebut sering dinamakan &hellip;..</p>', 'Haloklin', 'Termoklin', 'Termohalin', 'Termostar', 'Pinoklan', 'JWB_A_27.', 'JWB_B_27.', 'JWB_C_27.', 'JWB_D_27.', 'JWB_E_27.', 'B', 3),
(245, '28', 'type_b', '<p>Bila ada benda lain berukuran mirip Bumi, berada di orbit Bumi dan mengorbit Matahari, maka&hellip;.</p>', 'Suatu saat benda tersebut dapat menabrak Bumi, menyebabkan keduanya hancur dan membentuk benda-benda kecil seperti asteroid ', 'Benda tersebut dan Bumi tidak akan bertabrakan, dan sistem Tata Surya tetap seperti saat ini ', 'Akibat tabrakan benda tersebut dengan Bumi akan mengubah stabilitas sistem Tata Surya. ', 'Akibat tabrakan benda tersebut dengan Bumi, mengubah orbit Bumi mendekat ke Matahari. ', 'Akibat tabrakan benda tersebut dengan Bumi, mengubah orbit Bumi menjauh dari Matahari', 'JWB_A_28.', 'JWB_B_28.', 'JWB_C_28.', 'JWB_D_28.', 'JWB_E_28.', 'B', 3),
(246, '29', 'type_b', '<p>Kala&nbsp; yang&nbsp; memiliki&nbsp; rentang&nbsp; waktu&nbsp; sekitar&nbsp; 3 juta &ndash; 10.000&nbsp; tahun&nbsp; yang&nbsp; lalu pada masa ini masih liar dan labil karena silih bergantinya dua zaman adalah &hellip;..</p>', 'Pliosen', 'Oligosen', 'Miosen', 'Pleistosen', 'Eosen', 'JWB_A_29.', 'JWB_B_29.', 'JWB_C_29.', 'JWB_D_29.', 'JWB_E_29.', 'D', 3),
(247, '30', 'type_b', '<p>Apa yang dimaksud dengan galaksi elips adalah&hellip;</p>', 'Debu dan gas sedikit, tersusun dari bintang-bintang tua', 'Kaya akan gas dan debu, tersusun dari bintang-bintang tua', 'Debu dan gas banyak, tersusun dari bintang-bintang tua dan muda', 'Kaya akan gas dan debu, tersusun dari bintang-bintang muda', 'Debu dan gas sedikit, tersusun dari bintang-bintang muda', 'JWB_A_30.', 'JWB_B_30.', 'JWB_C_30.', 'JWB_D_30.', 'JWB_E_30.', 'A', 3),
(248, '31', 'type_b', '<p>Arus global yang mengalirkan massa air samudera yang berasal dari Samudera Pasifik melewati Perairan Indonesia menuju ke Samudera Hindia dikenal dengan istilah &hellip;.</p>', 'Arus Indo-Hindia ', 'Arus Samudera Pasifik ', 'Arus Arlindo ', 'Arus Pasifik-Hindia ', 'Arus Indo-Pasifik', 'JWB_A_31.', 'JWB_B_31.', 'JWB_C_31.', 'JWB_D_31.', 'JWB_E_31.', 'C', 3),
(249, '32', 'type_b', '<p>Pada suatu hari pada tanggal 30 Juli di kota Lisbon terjadi musim panas, sedangkan di kota Wellington pada saat waktu yang sama terjadi&hellip;..</p>', 'Musim Semi', 'Musim Gugur', 'Musim Dingin', 'Musim Panas', 'Musim Hujan', 'JWB_A_32.', 'JWB_B_32.', 'JWB_C_32.', 'JWB_D_32.', 'JWB_E_32.', 'C', 3),
(250, '33', 'type_b', '<p>Batuan intrusif ini memiliki nilai ekonomis tingi, karena merupakan batuan induk penghasil bjih nikel. Batuan ini bersifat sangat basa. Batuan intrusif ini memiliki ukuran kristal besar-besar, berwarna gelap kehijauan dan permukaannnya sangat kasar. Batuan beku dalam ini mengandung banyak olivine dan piroksen. Seperti pada gambar dibawah ini. Batuan tersebut adalah ....</p>\r\n<p>.<img src="images/K1.jpg" alt="" width="259" height="194" /></p>', 'Diorit', 'Granit', 'Peridotit', 'Gabro', 'Riolit', 'JWB_A_33.', 'JWB_B_33.', 'JWB_C_33.', 'JWB_D_33.', 'JWB_E_33.', 'C', 4),
(251, '34', 'type_b', '<p>Berapakah gaya Coriolis yang terjadi di sebuah kota yang terletak di lintang 30&deg; LS menggunakan Rumus Gaya Coriolis dengan &omega; adalah Kecepatan sudut bumi 1.5 x 10^3 Rad/s dan kecepatan angin 20 m/s dan ke mana pembelokannya&hellip;</p>', '3 x 10^3 ke arah kanan ', '3 x 10^3 ke arah kiri ', '3  x 10^4 ke arah kanan ', '3 x 10^4  ke arah kiri ', 'Tidak ada yang benar', 'JWB_A_34.', 'JWB_B_34.', 'JWB_C_34.', 'JWB_D_34.', 'JWB_E_34.', 'D', 4),
(252, '35', 'type_b', '<p><img src="images/K2.jpg" alt="" width="320" height="184" /></p>\r\n<p>Alat di atas merupakan salah satu instrumen oseanografi yang berguna untuk&hellip;</p>\r\n<div id="gtx-trans" style="position: absolute; left: -51px; top: 243.4px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', 'Mengukur gelombang laut', 'Mengukur arus laut', 'Mengukur pasang surut', 'Mengukur salinitas air laut', 'Mengukur kedalaman laut', 'JWB_A_35.', 'JWB_B_35.', 'JWB_C_35.', 'JWB_D_35.', 'JWB_E_35.', 'B', 4),
(253, '36', 'type_b', '<p>Pada tanggal 2 Maret 2016 terjadi gempa bumi di Kabupaten Malang yang mengakibatkan infrastruktur rusak, sehingga untuk antisipasi di masa depan, pemerintah perlu untuk membangun infrastruktur yang berkualitas, dapat diandalkan, berkelanjutan dan tahan lama sesuai dengan SGDs tujuan ke-9. Setelah diteliti, penyebab dari gempa tersebut adalah&nbsp; pergerakan&nbsp; sesar&nbsp; yang&nbsp; dipicu&nbsp; oleh&nbsp; tumbukan&nbsp; antara&nbsp; dua&nbsp; lempeng.&nbsp; Kedua&nbsp; lempeng tersebut adalah &hellip;</p>', 'lempeng Indo-Australia dan lempeng Pasifik ', 'lempeng Pasifik dan lempeng Eurasia ', 'lempeng Eurasia dan lempeng Indo-Australia ', 'lempeng Indo-Australia dan lempeng Eurasia ', 'lempeng Filipina dan lempeng Eurasia', 'JWB_A_36.', 'JWB_B_36.', 'JWB_C_36.', 'JWB_D_36.', 'JWB_E_36.', 'D', 4);
