(254, '37', 'type_b', '<p><img src="images/K3.jpg" alt="" width="306" height="272" /></p>\r\n<p>Jenis awan yang menyerupai gelombang dalam air dan umumnya lebar dari awan ini kurang lebih 300 kaki. Seperti pada gambar di atas adalah awan &hellip;</p>', 'Altocumulus Undulatus', 'Altocumulus Lentikularis', 'Altocumulus Stratiform', 'Altocumulus Castelanus ', 'Altocumulus Humilis', 'JWB_A_37.', 'JWB_B_37.', 'JWB_C_37.', 'JWB_D_37.', 'JWB_E_37.', 'A', 4),
(255, '38', 'type_b', '<p>Magnitudo mutlak sebuah bintang adalah M=10 dan magnitudo semunya adalah m=15. Jika absorpsi oleh materi antar bintang diabaikan, berapakah jarak antara bintang tersebut?</p>', '150 parsek', '100 parsek', '80 parsek', '50 parsek', '120 parsek', 'JWB_A_38.', 'JWB_B_38.', 'JWB_C_38.', 'JWB_D_38.', 'JWB_E_38.', 'B', 4),
(256, '39', 'type_b', '<p><img src="images/K4.jpg" alt="" width="170" height="227" /></p>\r\n<p>Perhatikan gambar diatas! Alat disamping merupakan buatan dari &hellip;&hellip;&hellip; dan berfungsi untuk mengukur &hellip;&hellip;..</p>', 'Bendix, mengukur curah hujan', 'Jordan, mengukur intensitas matahari', 'Hellman, mengukur curah hujan', 'Jordan, mengukur curah hujan', 'Hellman, mengukur intensitas matahari', 'JWB_A_39.', 'JWB_B_39.', 'JWB_C_39.', 'JWB_D_39.', 'JWB_E_39.', 'C', 4),
(257, '40', 'type_b', '<p>Teori gelombang yang menyatakan bahwa gaya gesek angin dengan permukaan air laut yang akan&nbsp; membangkitkan&nbsp; gelombang&nbsp; &nbsp; dibuat&nbsp; pertama&nbsp; kali&nbsp; oleh&nbsp; Admiral&nbsp; Sir&nbsp; Francis&nbsp; Beaufort (1808) yang kemudian dikenal sebagai skala angin Beaufort. Pernyataan kondisi angin yang terdapat di bawah ini yang paling benar adalah&hellip;..</p>', 'Angin moderate  breeze,  mempunyai  ciri  kecepatan  angin  11  -  16  knot  atau  5,5  -  7,9 m/dt,   ', 'Angin moderate breeze, mempunyai ciri kecepatan angin 4 - 6 knot atau 1,6 - 3,3 m/dt,   ', 'Angin moderate  breeze,  mempunyai  ciri  kecepatan  angin    7  -  10  knot  atau  3,4  -  5,4 m/dt,   ', 'Angin moderate breeze, mempunyai ciri kecepatan angin 17 - 121 knot atau 8,0 - 10,7 m/dt,   ', 'Angin moderate  breeze,  mempunyai  ciri  kecepatan  angin  11  -  16  knot  atau  5,5  -  7,9 m/dt', 'JWB_A_40.', 'JWB_B_40.', 'JWB_C_40.', 'JWB_D_40.', 'JWB_E_40.', 'E', 4),
(258, '41', 'type_b', '<p>Sebutkan nama alat ukur sederhana yang digunakan untuk mengukur kemiringan sudut atau elevasi suatu bidang&hellip;.</p>', 'Theodolite', 'Curvimeter', 'Clinometer', 'Waterpass', 'Grafido', 'JWB_A_41.', 'JWB_B_41.', 'JWB_C_41.', 'JWB_D_41.', 'JWB_E_41.', 'C', 2),
(259, '42', 'type_b', '<p>Di bawah ini yang merupakan salah satu skala peta dengan skala kecil adalah peta yang memiliki skala&hellip;..</p>', '1:1000', '1:50000', '1:55000', '1:500', '1:55500', 'JWB_A_42.', 'JWB_B_42.', 'JWB_C_42.', 'JWB_D_42.', 'JWB_E_42.', 'E', 2),
(260, '43', 'type_b', '<p><img src="images/kontur paket 2.png" alt="" width="200" height="203" /></p>\r\n<p>Berdasarkan gambar struktur theodolite diatas, disebut apakah no 9&hellip;..</p>', 'Sekrup A, B dan C', 'Penggerak halus', 'Lensa okuler', 'Nivo tabung', 'Lensa objektif', 'JWB_A_43.', 'JWB_B_43.', 'JWB_C_43.', 'JWB_D_43.', 'JWB_E_43.', 'C', 2),
(261, '44', 'type_b', '<p>Metode pemetaan topografi dengan cara melakukan kontak langsung dengan objek di lapangan merupakan metode pengukuran&hellip;.</p>', 'Fotogrametri', 'Terestris', 'Digitasi', 'Barometris', 'Remote sensing', 'JWB_A_44.', 'JWB_B_44.', 'JWB_C_44.', 'JWB_D_44.', 'JWB_E_44.', 'B', 2),
(262, '45', 'type_b', '<p>Pemasangan tanda batas (Bench Mark) pada kegiatan pendaftaran tanah untuk pertambangan dilaksanakan pada&hellip;.</p>', 'Setelah kegiatan pendaftaran', 'Sesudah kegiatan penentuan wilayah', 'Sebelum kegiatan pengukuran bidang tanah', 'Setelah menyiapakan perlatan dan dibutuhkan', 'Sebelum melakukan evaluasi', 'JWB_A_45.', 'JWB_B_45.', 'JWB_C_45.', 'JWB_D_45.', 'JWB_E_45.', 'C', 2),
(263, '46', 'type_b', '<p>Berikut adalah alat&nbsp; yang dapat digunakan untuk mendigitalisasi peta analog ke peta digital adalah &hellip;&hellip;</p>', 'Scanner', 'Fotocopy ', 'Tinta ', 'Computer', ' Jangka', 'JWB_A_46.', 'JWB_B_46.', 'JWB_C_46.', 'JWB_D_46.', 'JWB_E_46.', 'A', 2),
(264, '47', 'type_b', '<p>Pada proses perencanaan, dasar bangunan akan dinaikkan sebesar 80 cm dari permukaan as bangunan. Jika bacaan benang tengah pada rambu ukur di as bangunan adalah 1,853, maka didapatkan bacaan benang yang seharusnya&hellip;..</p>', '2, 653 ', '1,933 ', '1,773', ' 1,053 ', '2,135 ', 'JWB_A_47.', 'JWB_B_47.', 'JWB_C_47.', 'JWB_D_47.', 'JWB_E_47.', 'B', 3),
(265, '48', 'type_b', '<p>GPS dapat digunakan untuk menentukan lokasi yang telah ditandai. Tanda tersebut terdiri dari&nbsp; koordinat lintang (latitude) dan bujur (longitude) dan biasanya digambarkan dalam bentuk titik dan simbol sesuai jenis lokasi adalah....</p>', 'Bearing', 'Elevation ', 'Mark ', 'Route ', 'Waypoint ', 'JWB_A_48.', 'JWB_B_48.', 'JWB_C_48.', 'JWB_D_48.', 'JWB_E_48.', 'E', 3),
(266, '49', 'type_b', '<p>Letak dipermukaan bumi dapat ditentukan dengan bantuan penyelarasan (synchronization) sinyal satelit. Sebutkan nama satelit yang dikembangkan oleh Departemen Pertahanan Amerika Serikat&hellip;..</p>', 'GLONASS  ', 'NAVSTAR GPS ', 'IRNSS ', 'TIROS', 'NOAA', 'JWB_A_49.', 'JWB_B_49.', 'JWB_C_49.', 'JWB_D_49.', 'JWB_E_49.', 'B', 3),
(267, '50', 'type_b', '<p>Terdapat beberapa manfaat dari Sistem Informasi Geospasial (SIG) salah satunya dalam bidang manajemen tata guna lahan yang termasuk manfaat yang dimiliki Sistem Informasi Geospasial (SIG) pada bidang ini adalah&hellip;..</p>', 'Potensi persebaran area lahan potensial dan kritis', 'Memanfaatkan perubahan pembangunan lahan', 'Membantu dalam membuat perencanaan setiap wilayah pemanfaatan lahan', 'Menyusun rencana-rencana pembangunan ulang daerah bencana', 'Area hutan yang masih baik dan hutan yang telah rusak', 'JWB_A_50.', 'JWB_B_50.', 'JWB_C_50.', 'JWB_D_50.', 'JWB_E_50.', 'C', 3),
(268, '51', 'type_b', '<p><img src="images/KONTUR bukit.jpg" alt="" width="250" height="188" /></p>\r\n<p>Perhatikan gambar di atas!<br />Gambar diatas merupakan gambar peta kontur dari&hellip;.</p>', 'Bukit ', 'Jalan ', 'Sungai', ' Dataran  ', 'Laut ', 'JWB_A_51.', 'JWB_B_51.', 'JWB_C_51.', 'JWB_D_51.', 'JWB_E_51.', 'A', 3),
(269, '52', 'type_b', '<p>Keterkaitan antara banyaknya perumahan yang padang dengan perkotaan merupakan salah satu unsur interpretasi citra berupa&hellip;.</p>', 'Bayangan ', 'Tekstur ', 'Ukuran ', 'Asosiasi ', 'Rona', 'JWB_A_52.', 'JWB_B_52.', 'JWB_C_52.', 'JWB_D_52.', 'JWB_E_52.', 'C', 3),
(270, '53', 'type_b', '<p>Berikut ini yang tepat dari tahapan reduksi jarak adalah&hellip;&hellip;</p>', 'Fisik bumi â€“ Ellipsoid â€“ Geoid â€“ Proyeksi ', 'Fisik bumi â€“ Geoid â€“ Proyeksi â€“ Ellipsoid ', 'Fisik bumi â€“ Geoid â€“ Ellipsoid â€“ Proyeksi ', 'Fisik bumi â€“ proyeksi â€“ Ellipsoid â€“ Geoid', 'Fisik bumi â€“ Ellipsoid â€“ Proyeksi â€“ Geoid', 'JWB_A_53.', 'JWB_B_53.', 'JWB_C_53.', 'JWB_D_53.', 'JWB_E_53.', 'C', 4),
(271, '54', 'type_b', '<p><img src="images/GT14b.png" alt="" width="259" height="178" /></p>\r\n<p>Diketahui polygon tertutup dengan sudut azimuth 135Ëš, jika &beta;1 adalah 80Ëš10&rsquo;20&rdquo;, &beta;2 adalah 60Ëš15&rsquo;30&rdquo; dan &beta;3 adalah 39Ëš34&rsquo;01&rdquo;. Koordinat titik A (100,0) tentukan nilai koordinat di titik C&hellip;.</p>', '168,1526 ; 27,5363', '212,6381 ; 38,8368', '173.3328 ; 23,7382', ' 167,3195 ; 26,8841 ', '211,3828 ; 36,3823', 'JWB_A_54.', 'JWB_B_54.', 'JWB_C_54.', 'JWB_D_54.', 'JWB_E_54.', 'D', 4),
(272, '55', 'type_b', '<p>Berikut ini merupakan tahapan pengatur penyimpat datar setelah tripod/statif sudah berdiri di atas patok</p>\r\n<p>A.&nbsp;Putar kedua sekrup tersebut hingga gelembung nivo berada di tengah<br />B.&nbsp;Sejajarkan teropong dengan dua sekrup penyetal pada tribach<br />C.&nbsp;Putar teropong hingga tegak lurus dengan dua sekrup penyetel sebelumnya<br />D.&nbsp;Pasang pesawat di atas kepala statif dengan mengikat lendasan pesawat dan sekrup pengunci di kepala statif<br />E.&nbsp;Periksa Kembali dengan memutar teropong kesegala arah, jika gelembung nivo tidak berubah, maka alat siap digunakan<br />F.&nbsp;Putar satu sekrup tersisa hingga gelembung nivo tepat berada di tengah-tengah lingkaran nivo</p>\r\n<p>Bagaimana susunan pengaturan alat penyimpat datar yang tepat jika tripot/satif bediri di atas BM (Bench Mark)&hellip;&hellip;.</p>', 'D ; C ; B ; A ; F ; E', 'D ; B ; C ; F ; A ; E', 'D ; B ; A ; C ; F ; E ', 'D ; A ; C ; F ; B ; E', 'D ; C ; A ; B ; F ; E', 'JWB_A_55.', 'JWB_B_55.', 'JWB_C_55.', 'JWB_D_55.', 'JWB_E_55.', 'C', 4),
(273, '56', 'type_b', '<p>Pada peta topografi dengan interval kontur 50 meter, tergambar 2 bukit dengan jarak antar puncaknya 30cm. Jarak sebenarnya dua puncak tersebut adalah&hellip;..</p>', '15 km ', '10 km ', '18 km ', '25 km ', '30 km', 'JWB_A_56.', 'JWB_B_56.', 'JWB_C_56.', 'JWB_D_56.', 'JWB_E_56.', 'D', 4),
(274, '57', 'type_b', '<p>Disebut apakah kesalahan yang disebabkan oleh sinyal yang diterima berasal dari lebih dari satu lintasan&hellip;.</p>', 'Sistematika ', 'Acak ', 'Teknik ', 'Multipath  ', 'Error', 'JWB_A_57.', 'JWB_B_57.', 'JWB_C_57.', 'JWB_D_57.', 'JWB_E_57.', 'D', 4),
(275, '58', 'type_b', '<p><img src="images/GT18b.png" alt="" width="260" height="134" /></p>\r\n<p>Berapa beda tinggi antara titik A dan titik Bâ€¦..</p>', '1,478 ', '1,784 ', '-1,784 ', '-1,478 ', '1,581', 'JWB_A_58.', 'JWB_B_58.', 'JWB_C_58.', 'JWB_D_58.', 'JWB_E_58.', 'A', 4),
(276, '59', 'type_b', '<p>Alat ukur yang telah lama digunakan tetapi alat tersebut tidak dilakukan kalibrasi dapat menimbulkan kesalahan &hellip;..</p>', 'Kecil ', 'Sistematika ', 'Besar', ' Acak ', 'Teknik', 'JWB_A_59.', 'JWB_B_59.', 'JWB_C_59.', 'JWB_D_59.', 'JWB_E_59.', 'B', 4),
(277, '60', 'type_b', '<p>Apa yang terjadi jika pada saat proses kegiatan pengukuran dan pemilik tanah tidak dapat hadir pada waktu yang telah ditentukan untuk menunjukkan batas-batas bidang makan kegiatan pengukuran sebaiknya&hellip;.</p>', 'Pengukuran tetap dilaksanakan  ', 'Pengukuran tidak dapat dilaksanakan', 'Pengukuran diwakilkan ', 'Penunjuk batas diganti dengan orang lain ', 'Terserah kepada surveyor di lapangan', 'JWB_A_60.', 'JWB_B_60.', 'JWB_C_60.', 'JWB_D_60.', 'JWB_E_60.', 'B', 4),
(278, '61', 'type_b', '<p dir="ltr" style="line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 0pt;" role="presentation">Sebuah balok dengan massa 3 kg diberi gaya sebesar 15 N yang membentuk sudut 60&deg; terhadap lantai kasar bergerak dengan percepatan <img src="images/F_61b_1.png" alt="" width="41" height="21" />, maka berapakah koefisian gesekan balok dengan lantai?</p>', '', '', '', '', '', 'JWB_A_61.png', 'JWB_B_61.png', 'JWB_C_61.png', 'JWB_D_61.png', 'JWB_E_61.png', 'A', 4),
(279, '62', 'type_b', '<p>Sebuah massa dihubungkan pada pegas B, sedangkan sebuah massa yang dihubungkan pada pegas C dua kali massa pada pegass B. Jika konstanta pegas B 6 kali pegas C. Perbandingan frekuensi getar pegas C terhadap B adalah&hellip;</p>', '', '', '', '', '', 'JWB_A_62.png', 'JWB_B_62.png', 'JWB_C_62.png', 'JWB_D_62.png', 'JWB_E_62.png', 'D', 3),
(280, '63', 'type_b', '<p>Suatu bola dengan massa 2 kg dilempar vertikal ke atas dari permukaan tanah. Pada suatu ketinggian tertentu benda tersebut memiliki energi potensial 12 joule dan memiliki kecepatan 8m/s. Kecepatan benda saat kembali mencapai permukaan tanah adalah&hellip;</p>', '9 m/s', '8,5 m/s', '8,7 m/s', '8,2 m/s', '8 m/s', 'JWB_A_63.', 'JWB_B_63.', 'JWB_C_63.', 'JWB_D_63.', 'JWB_E_63.', 'C', 3),
(281, '64', 'type_b', '<p>Balok A seberat 50 N diikat dengan tali mendatar pada tembok. Balok B yang memiliki berat 300 N ditarik dengan gaya luar F. Jika koefisien gesek antara kedua balok = 0,2 dan koefisien gesek antara balok Q dengan meja = 0,5. Berapa F minimum agar balok Q dapat ditarik?</p>', '120 N', '125 N', '200 N', '225 N', '160 N', 'JWB_A_64.', 'JWB_B_64.', 'JWB_C_64.', 'JWB_D_64.', 'JWB_E_64.', 'E', 4),
(282, '65', 'type_b', '<p><img src="images/F_65b_1.png" alt="" width="102" height="84" /></p>\r\n<p>Jika sistem di atas setimbang dengan sudut 37&deg; dan m=6 kg, maka besar tegangan tiap tali adalah...</p>', '80 N dan 100 N', '75 N dan 45 N', '100 N dan 200 N', '120 N dan 75 N', '100 N dan 45  N', 'JWB_A_65.', 'JWB_B_65.', 'JWB_C_65.', 'JWB_D_65.', 'JWB_E_65.', 'A', 4),
(283, '66', 'type_b', '<p>Seseorang mampu mengangkat benda (berat jenis = <img src="images/F_66b_1.png" alt="" width="85" height="30" />) dengan beban maksimum 60 kg di udara. Jika orang tersebut berada di dalam air maka orang tersebut dapat mengangkat benda tersebut maksimum&hellip;</p>', '60 kg', '120 kg', '75 kg', '100 kg', '25 kg', 'JWB_A_66.', 'JWB_B_66.', 'JWB_C_66.', 'JWB_D_66.', 'JWB_E_66.', 'B', 3),
(284, '67', 'type_b', '<p>Balok kayu 4 kg diam di lantai dasar kasar yang memiliki koefisien gesek 0,2. Balok lalu ditarik dengan gaya sebesar 10 N selama 5 detik. Jarak total yang ditempuh balok dari penarikan sampai berhenti adalah&hellip;</p>', '35 m', '40,5 m', '31,2 m', '33 m', '32,8 m', 'JWB_A_67.', 'JWB_B_67.', 'JWB_C_67.', 'JWB_D_67.', 'JWB_E_67.', 'E', 4),
(285, '68', 'type_b', '<p>Sebuah balok bermassa M = 500 gram diam pada suatu permukaan meja licin. Balok tersebut kemudian dihubungkan dengan balok lain dengan massa 200 gram yang bergantung dan menyentuh samping meja yang kasar melalui seutas tali dan sebuah katrol ringan licin. Meja kemudian bergerak horizontal dengan percepatan a = <img src="images/F_68b_1.png" alt="" width="64" height="22" />. Berapakah koefisien gesek antara balok m dengan pinggiran meja agar M dan m&nbsp; dengan pinggiran meja agar M dan m tidak bergerak relative terhadap meja?</p>', '0,5', '0,8', '0,7', '0,2', '0,3', 'JWB_A_68.', 'JWB_B_68.', 'JWB_C_68.', 'JWB_D_68.', 'JWB_E_68.', 'C', 4),
(286, '69', 'type_b', '<p>Diberikan diameter piston kecil 5 cm dan diameter piston besar 60 cm. Besar gaya f untuk menyeimbangkan sistem dengan gaya F sebesar 2400 N adalah&hellip;</p>', '16 N', '12,4 N', '18,3 N', '17,2 N', '16,7 N', 'JWB_A_69.', 'JWB_B_69.', 'JWB_C_69.', 'JWB_D_69.', 'JWB_E_69.', 'E', 2),
(287, '70', 'type_b', '<p>Perhatikan gambar di bawah ini!</p>\r\n<p><img src="images/F_70b_1.png" alt="" width="91" height="81" /></p>\r\n<p>Kotak bermassa m kg ditekan menghadap dinding dengan gaya konstan F. Jika koefisien gesek statis dan kinetis antara balok dan dinding masing-masing &mu;s dan &micro;k. Maka untuk kasus balok akan meluncur jatuh, hubungan berikut yang benar adalah...</p>', '', '', '', '', '', 'JWB_A_70.png', 'JWB_B_70.png', 'JWB_C_70.png', 'JWB_D_70.png', 'JWB_E_70.png', 'D', 4),
(288, '71', 'type_b', '<p>Sebuah balok massanya 4 kg yang terletak pada bidang datar kasar diberi gaya konstan sebesar 20 N membentuk sudut&nbsp; 37&deg; terhadap bidang horizontal. Jika koefisien gesek antara balok dan lantai 0,4 maka besar kecepatan benda setelah 5 detik adalah&hellip;</p>', '0 m/s', '2 m/s', '4 m/s', '6 m/s', '8 m/s', 'JWB_A_71.', 'JWB_B_71.', 'JWB_C_71.', 'JWB_D_71.', 'JWB_E_71.', 'D', 4),
(289, '72', 'type_b', '<p>Sebuah massa dihubungkan pada pegas A, sedangkan sebuah massa yang dihubungkan pada pegas B tiga kali massa pada pegas A. Jika konstanta pegas A 12 kali pegas B. Perbandingan frekuensi getar pegas A terhadap B adalah&hellip;</p>', '2', '6', '10', '4', '8', 'JWB_A_72.', 'JWB_B_72.', 'JWB_C_72.', 'JWB_D_72.', 'JWB_E_72.', 'B', 3),
(290, '73', 'type_b', '<p>Pernyataan berikut yang salah adalah...</p>', 'Energi sinar ultraviolet lebih besar dari gelombang radio', 'Panjang gelombang sinar gamma lebih pendek dari sinar X', 'Panjang gelombang sinar tampak biru lebih pendek dari sinar hijau', 'Frekuensi sinar tampak kuning lebih kecil dari sinar tampak merah', 'Energi sinar gamma lebih besar dari energi sinar UV', 'JWB_A_73.', 'JWB_B_73.', 'JWB_C_73.', 'JWB_D_73.', 'JWB_E_73.', 'D', 2),
(291, '74', 'type_b', '<p>Seratus gram es bersuhu -15&deg;C dipanaskan sampai 75% dari es tersebut mencair dengan suhu 0&deg;C. Jika kalor lebur es 80 kal/g dan kalor jenis es 0,5 kal/g&deg;C, maka jumlah kalor yang dibutuhkan untuk melebur 75% es tersebut adalah&hellip;</p>', '787,5 kalori', '785 kalori', '786, 5 kalori', '787,4 kalori', '784,5 kalori', 'JWB_A_74.', 'JWB_B_74.', 'JWB_C_74.', 'JWB_D_74.', 'JWB_E_74.', 'A', 3),
(292, '75', 'type_b', '<p>Sebuah planet 5 kali massa bumi dan diameternya 3 kali diameter bumi. Jika kuat medan gravitasi di permukan bumi sebesar g, maka kuat medan gravitasi dipermukaan planet itu sebesar&hellip;</p>', '', '', '', '', '', 'JWB_A_75.png', 'JWB_B_75.png', 'JWB_C_75.png', 'JWB_D_75.png', 'JWB_E_75.png', 'B', 3),
(293, '76', 'type_b', '<p>Seorang penderita hipermetropi memakai lensa dengan kekuatan 4/3 dioptri. Jika orang tersebut ingin dapat membaca pada jarak 30 cm, titik dekat orang tersebut adalah&hellip;</p>', '60 cm', '50 cm', '45 cm', '55 cm', '40 cm', 'JWB_A_76.', 'JWB_B_76.', 'JWB_C_76.', 'JWB_D_76.', 'JWB_E_76.', 'B', 2),
(294, '77', 'type_b', '<p>Tingkat terang sebuah bintang yang dilihat oleh pengamat di bumi disebut &hellip;</p>', 'Luminositas Bintang', 'Magnitudo Mutlak', 'Magnitudo Sebenarnya', 'Amplitudo', 'Magnitudo Semu', 'JWB_A_77.', 'JWB_B_77.', 'JWB_C_77.', 'JWB_D_77.', 'JWB_E_77.', 'E', 2),
(295, '78', 'type_b', '<p>Ikhsan dan Imam berada di dalam kereta api yang bergerak, sedangkan Bayu diam di stasiun. Ikhsan sedang makan sepiring nasi goreng. Dengan memperhatikan teori relativitas khusus, manakah dari pernyataan berikut yang benar?</p>', 'Selang waktu yang dibutuhkan Ikhsan untuk menghabiskan nasi goreng menurut Imam dan Bayu sama.', 'Menurut Imam, Ikhsan menghabiskan nasi goreng dalam selang waktu yang lebih panjang dari menurut Bayu.', 'Menurut Imam, Ikhsan menghabiskan nasi goreng dalam selang waktu yang lebih singkat dari menurut Bayu.', 'Jarak antar baris kursi di kereta api menurut Ikhsan, Imam, dan Bayu sama.', 'Jarak antara baris kursi di kereta api menurut Ikhsan dan Imam lebih pendek daripada menurut Bayu.', 'JWB_A_78.', 'JWB_B_78.', 'JWB_C_78.', 'JWB_D_78.', 'JWB_E_78.', 'C', 4),
(296, '79', 'type_b', '<p>Besar medan gravitasi di permukaan planet A adalah empat kali di permukaan planet B. Jika massa planet A adalah 1/9 massa planet B, maka jari-jari planet B &hellip; kali jari-jari planet A.</p>', '5 kali', '4 kali', '8 kali', '6 kali', '2 kali', 'JWB_A_79.', 'JWB_B_79.', 'JWB_C_79.', 'JWB_D_79.', 'JWB_E_79.', 'D', 2),
(297, '80', 'type_b', '<p>Planet jupiter memiliki jarak orbit ke matahari yang diperkirakan sama dengan empat kali jarak orbit bumi ke matahari. Periode revolusi bumi mengelilingi matahari 1 tahun. Berapakah periode jupiter tersebut mengelilingi matahari?</p>', '5 tahun', '8 tahun', '9 tahun', '10 tahun', '6 tahun', 'JWB_A_80.', 'JWB_B_80.', 'JWB_C_80.', 'JWB_D_80.', 'JWB_E_80.', 'B', 2),
(298, '81', 'type_b', '<p>Metode <em>open pit mining</em> banyak digunakan pada pertambangan di Indonesia. Undang-undang No. 4 Tahun 2009 tentang Pertambangan Mineral dan Batubara mewajibkan perusahaan pertambangan untuk melakukan reklamasi dan kegaiatan pascatambang atas areal tambang yang diusahakannya. Adapun urgensi dari <strong>reklamasi pasca penambangan</strong> adalah&hellip;</p>', 'Menghasilkan ekosistem yang lebih baik daripada pra kegiatan penambangan', 'Agar tidak memakan korban jiwa seperti yang terjadi pada beberapa lahan bekas tambang di Kalimantan', 'Produktivitas lahan pasca penambangan yang rendah jika tidak dilakukan reklamasi', 'Kandungan pH tanah yang tidak stabil menyebabkan terjadinya pencemaran tanah meluas', 'Tidak ada jawaban yang benar', 'JWB_A_81.', 'JWB_B_81.', 'JWB_C_81.', 'JWB_D_81.', 'JWB_E_81.', 'A', 4),
(299, '82', 'type_b', '<p>Penelitian pada tahun 2011 menunjukkan korelasi <em>urban heat island effect</em> di Jakarta dengan beberapa faktor. Di bawah ini yang termasuk faktor penyebab terjadinya kondisi tersebut adalah ...</p>', 'Green house gases di urban area Jakarta meningkat', 'Pemakaian energi listrik yang bertambah 80% guna mengatur suhu lingkungan', 'Peningkatan temperatur perkotaan', 'Meningkatnya kepadatan penduduk', 'Kondisi lingkungan Jakarta yang semakin padat', 'JWB_A_82.', 'JWB_B_82.', 'JWB_C_82.', 'JWB_D_82.', 'JWB_E_82.', 'D', 4),
(300, '83', 'type_b', '<p>Area Gedung Teknik Geomatika ITS pada siang hari pukul 12.30 terukur cuaca cerah dengan temperature 41oC dengan setiap 1m<span style="color: #111111; font-family: Roboto, sans-serif; font-size: 18px; background-color: #ffffff;">&sup3;</span>&nbsp;udara mengandung uap air sebanyak 24,58 gram. Jika pada suhu maksimum yang sama dengan konsentrasi air maksimumnya adalah 29,134 gram, maka kelembaban udara <em>relative</em> Area Gedung Teknik Geomatika ITS adalah &hellip;</p>', '84,3688%', '128,2025%', '67,8701%', '68,54%', '66,041%', 'JWB_A_83.', 'JWB_B_83.', 'JWB_C_83.', 'JWB_D_83.', 'JWB_E_83.', 'A', 4),
(301, '84', 'type_b', '<p>Guna menunjang aktivitas mahasiswa ITS, dibangun jalan Teknik Sipil, Teknik Perkapalan, Teknik Geomatika, dan Teknik Mesin Industri. Jalan-jalan tersebut ditujukan guna menghubungkan Departemen Teknik Geomatika, Departemen Teknik Komputer, Departemen Teknik Sistem Perkapalan, Departemen Teknik Lingkungan, dan Departemen Fisika. <strong>Tingkat interaksi wilayah</strong> Kampus ITS adalah &hellip;</p>', '0,8', '0,7', '0,6', '1', '0,75', 'JWB_A_84.', 'JWB_B_84.', 'JWB_C_84.', 'JWB_D_84.', 'JWB_E_84.', 'A', 2),
(302, '85', 'type_b', '<p><img src="images/G_2pengembangan wilayah.png" alt="" width="381" height="215" /></p>\r\n<p>Perkembangan wilayah pada gambar cenderung menuju pusat perdagangan (Pelabuhan Tanjung Perak). Faktor apa yang menyebabkan kecenderungan wilayah terjadi seperti pada gambar?</p>', 'Jalur distribusi entitas barang dan manusia skala nasional', 'Memiliki sumber daya alam perikanan yang berpotensi besar', 'Sebagian besar masyarakat bekerja pada bidang perikanan tangkap', 'Ciri demografis mengandalkan sektor distribusi ', 'Daerah sekitar Pelabuhan memiliki kontur yang landai sehingga cocok digunakan sebagai pemukiman', 'JWB_A_85.', 'JWB_B_85.', 'JWB_C_85.', 'JWB_D_85.', 'JWB_E_85.', 'A', 3),
(303, '86', 'type_b', '<p>Interaksi antarwilayah pada Surabaya dan Mojokerto dapat ditingkatkan karena kedua wilayah dapat saling melengkapi kebutuhannya. Adapun bentuk interaksi yang saling melengkapi apabila wilayah-wilayah ...</p>', 'memiliki potensi keunggulan yang berbeda-beda', 'mengembangkan program interaksi antarwilayah karena kedua wilayah saling berdekatan', 'memiliki kelebihan dan kekurangan yang dapat dipenuhi oleh suatu wilayah dengan wilayah lainnya', 'mengembangkan benuk komunikasi untuk berinteraksi antarwilayah memanfaatkan pembangunan infrastruktur yang baik', 'Tidak ada jawaban yang benar', 'JWB_A_86.', 'JWB_B_86.', 'JWB_C_86.', 'JWB_D_86.', 'JWB_E_86.', 'C', 4),
(304, '87', 'type_b', '<p>Seorang mahasiswa Teknik Geomatika ITS melakukan survey lapangan yang menghasilkan beberapa variabel hingga menemukan bahwa wilayah tersebut rentan terhadap banjir. Karakteristik wilayah seperti apa yang menyebabkan mahasiswa Teknik Geomatika ITS dapat menyimpulkan bahwa wilayah tersebut rentan longsor?</p>', 'Tebing yang terdapat retakan tapal kuda', 'Tebing dengan kemiringan lereng sebesar 16,5Â°', 'Tanaman pengisi yang bersifat heterogen', 'Bukit dataran tinggi sebagai hulu sungai', 'Endapan vulkanik dengan curah hujan tinggi', 'JWB_A_87.', 'JWB_B_87.', 'JWB_C_87.', 'JWB_D_87.', 'JWB_E_87.', 'A', 3),
(305, '88', 'type_b', '<p>Sebuah industri rumah tangga olahan ikan di Surabaya biasa mendapatkan stok ikan dari nelayan Pantai Kenjeran serta menjualnya ke Pasar Manyar. Industri tersebut membutuhkan bahan baku 3,78 ton perharinya dengan hasil olahan jadinya mencapai 4016 kg. Di mana sebaiknya lokasi industrI dibangun?</p>', 'Di dekat Pantai Kenjeran', 'Di dekat Pasar Manyar', 'Di antara Pantai Kenjeran dan Pantai Manyar', 'Berada di Pantai Kenjeran', 'Berada di Pasar Manyar', 'JWB_A_88.', 'JWB_B_88.', 'JWB_C_88.', 'JWB_D_88.', 'JWB_E_88.', 'B', 4),
(306, '89', 'type_b', '<p>Penduduk provinsi Jawa Timur pada tahun 2021 sebanyak&nbsp; 39,74 juta terdapat kelahiran 600 ribu bayi. Pada Wanita kelompok umur 21-26 dengan jumlah 165 ribu jiwa, terjadi kelahiran sebanyak 21,6 ribu bayi. Berdasarkan data tersebut, angka kelahiran kelompok umur wanita adalah &hellip;</p>', '144', '148, 8', '137,76', '149,76', '151', 'JWB_A_89.', 'JWB_B_89.', 'JWB_C_89.', 'JWB_D_89.', 'JWB_E_89.', 'A', 4),
(307, '90', 'type_b', '<p>Gunung Agung merupakan salah satu gunung aktif di Provinsi Bali. Suatu Ketika muncul ciriciri sebagai berikut:</p>\r\n<p>(1) adanya peningkatan intensif kegiatan seismik</p>\r\n<p>(2) aktivitas gunung api dapat berlanjut</p>\r\n<p>(3) jika aktivitas seismik meningkat, letusan dapat terjadi dalam waktu 2 pekan</p>\r\n<p>Berdasarkan ciri-ciri tersebut, maka aktivitas gunung api menunjukkan status &hellip;</p>', 'normal', 'awas', 'siaga', 'waspada I', 'waspada II', 'JWB_A_90.', 'JWB_B_90.', 'JWB_C_90.', 'JWB_D_90.', 'JWB_E_90.', 'C', 2),
(308, '91', 'type_b', '<p>Mitigasi bencana dapat dilakukan dengan cara mengurangi <em>vulnerability</em> pendudukdan pemerintah. Urgensi dari mengurangi <em>vulnerability</em> pada mitigasi bencana adalah&hellip;</p>', 'Menghindarkan dari bencana yang lebih besar', 'Mengurangi kerugian fisik dan materi', 'Mengurangi probabilitas terjadinya bencana', 'Meminimalisasi usaha manusia dalam merestrukturisasi wilayah bencana', 'Menambah kesiapsiagaan terhadap bencana', 'JWB_A_91.', 'JWB_B_91.', 'JWB_C_91.', 'JWB_D_91.', 'JWB_E_91.', 'B', 2),
(309, '92', 'type_b', '<p><strong><em>Blue carbon</em></strong> merupakan skenario efektif dalam pengurangan emisi dunia. Indonesia sebagai negara kepulauan terbesar memiliki potensi tinggi dalam pemanfaatan <em>blue carbon</em>. Namun pemanfaatannya hingga kini belum optimal, Adapun <em>kendala</em> tersebut adalah &hellip;</p>', 'Adanya anggapan bahwa laut bukan komponen penting dalam penurunan emisi gas rumah kaca', 'Penelitian mengenai efektivitas bakau dan padang lamun di Indonesia masih minim', 'Pendataan Kawasan potensi blue carbon belum menyeluruh, menyulitkan analisis hasil', 'Green carbon telah cukup dalam mengurangi emisi dunia hingga beberapa tahun ke depan', 'Tidak ada jawaban yang benar', 'JWB_A_92.', 'JWB_B_92.', 'JWB_C_92.', 'JWB_D_92.', 'JWB_E_92.', 'A', 3),
(310, '93', 'type_b', '<p>Indonesia merupakan negara dengan potensi pemanfaatan garis pantai tinggi, termasuk pada produksi garam. Namun dengan salinitas air laut Indonesia yang rendah menyebabkan produksi garam nasional rendah. Akibatnya dari rendahnya produksi garam nasional adalah ...</p>', 'Berkurangnya devisa negara akibat Tindakan impor ', 'Petani garam beralih profesi menjadi nelayan pada tambak udang', 'Konsumsi garam tahunan nasional tidak mencapai target', 'Industri olahan makanan akan merugi karena pasokan garam tidak tercukupi', 'Kabupaten Cirebon tidak lagi menjadi produsen garam rakyat terbesar di Indonesia', 'JWB_A_93.', 'JWB_B_93.', 'JWB_C_93.', 'JWB_D_93.', 'JWB_E_93.', 'A', 3),
(311, '94', 'type_b', '<p>Pencurian ikan setahun ke belakang mengalami peningkatan setelah adanya moratorium pengeboman kapa lasing pencuri ikan. Banyaknya ikan yang dicuri nelayan asing karena &hellip;</p>', 'Wilayah laut sangat terbuka', 'Sebagian besar laut dangkal', 'Wilayah laut sangat luas', 'Garis batas wilayah tidak jelas', 'Wilayah laut yang banyak pulau', 'JWB_A_94.', 'JWB_B_94.', 'JWB_C_94.', 'JWB_D_94.', 'JWB_E_94.', 'D', 2),
(312, '95', 'type_b', '<p>Saat akan melakukan pengambilan kenampakan permukaan bumi pada siang hari dengan sistem penginderaan jauh pasif, gambar yang dihasilkan kabur. Kondisi ini diduga akibat dari pengambilan data yang dilakukan pada saat cuaca mendung. Berdasarkan informasi tersebut, jenis hamburan yang menyebabkan hasil gambar menjadi kabur atau tidak jelas adalah&hellip;</p>', 'Hamburan umum', 'Hamburan Rayliegh', 'Hamburan Mie', 'Hamburan non-selektif', 'Hamburan atmosfer', 'JWB_A_95.', 'JWB_B_95.', 'JWB_C_95.', 'JWB_D_95.', 'JWB_E_95.', 'C', 3),
(313, '96', 'type_b', '<p>Kesuburan tanah merupakan sifat lahan yang harus dipertahankan secara berkelanjutan dalam pembangunan pertanian. Namun, kenyataannya ada unsur hara yang hilang sehinga harus dilakukan upaya pencegahan melalui kegiatan-kegiatan berikut, <em>kecuali</em> &hellip;</p>', 'terasering', 'contour farming', 'crop rotation', 'contour ploughing ', 'strips cropping', 'JWB_A_96.', 'JWB_B_96.', 'JWB_C_96.', 'JWB_D_96.', 'JWB_E_96.', 'D', 3),
(314, '97', 'type_b', '<p>Indonesia merupakan negara yang dilewati garis khatulistiwa. Hal tersebut menyebabkan Indonesia berpotensi mengembangkan energi matahari sebagai alternatif energi. Adapun&nbsp; akibat jika Indonesia berhasil memanfaatkan energi matahari tersebut secara masif adalah&hellip;</p>', 'Rasio elektrifikasi Kalimantan Barat sebagai daerah yang dilewati garis khatulistiwa meningkat signifikan', 'Indonesia mengalami peningkatan dalam rasio bauran energi baru terbarukan', 'Konsumsi listrik yang dihasilkan sel surya akan meningkat ', 'Energi matahari digunakan sebagai energi tumpuan Indonesia menggantikan batubara', 'Penggunaan horizontal axis wind turbine yang membahayakan burung dapat direduksi', 'JWB_A_97.', 'JWB_B_97.', 'JWB_C_97.', 'JWB_D_97.', 'JWB_E_97.', 'B', 4),
(315, '98', 'type_b', '<p>Wilayah pesisir di Surabaya banyak dimanfaatkan penduduk sebagai pemukiman karena&hellip;</p>', 'aksesibilitas yang tinggi', 'kesuburan tanah tinggi', 'ketersediaan sarana prasarana', 'air yang melimpah', 'topografi yang datar', 'JWB_A_98.', 'JWB_B_98.', 'JWB_C_98.', 'JWB_D_98.', 'JWB_E_98.', 'C', 2),
(316, '99', 'type_b', '<p>Langkah yang harus dihindari oleh Indonesia untuk menghindari kerugian bangsa dalam konteks Indonesia-Malaysia-Thailand Growth Triangle (IMT-GT) adalah ...</p>', 'Melakukan filterisasi budaya berdasarkan entitas kebangsaan', 'Tidak mengambil bagian dalam perdagangan regional', 'Tidak meningkatkan kondisi infrastruktur perbatasan', 'Tidak mengirim tenaga kerja Indonesia ke luar negeri', 'Meningkatkan hubungan diplomatik guna memainkan politik dua kaki di luar regional', 'JWB_A_99.', 'JWB_B_99.', 'JWB_C_99.', 'JWB_D_99.', 'JWB_E_99.', 'B', 4),
(317, '100', 'type_b', '<p>Wilayah prioritas pemasaran bahan kebutuhan pokok seperti beras dan minyak goreng adalah wilayah yang&hellip;</p>', 'Pertumbuhan ekonominya tinggi', 'Pendidikan penduduknya rendah', 'Kepadatan penduduknya tinggi', 'Tingkat migrasi penduduknya rendah', 'Pertumbuhan penduduknya tinggi', 'JWB_A_100.', 'JWB_B_100.', 'JWB_C_100.', 'JWB_D_100.', 'JWB_E_100.', 'C', 2),
(318, '1', 'type_c', '<p>Terdapat dua buah lingkaran A dan lingkaran B dengan jari-jarinya berturut-turut adalah 7 dan 3 satuan panjang dan bersinggungan di luar pada titik P. Jika Q merupakan perpotongan garis singgung persekutuan luarnya, nilai &lfloor;PQ&rfloor; dengan PQ merupakan jarak antara titik P dan Q adalah &hellip;&nbsp;</p>', '14', '30', '15', '10', '12', 'JWB_A_1.', 'JWB_B_1.', 'JWB_C_1.', 'JWB_D_1.', 'JWB_E_1.', 'D', 3),
(319, '2', 'type_c', '<p>Sebuah persegi panjang WXYZ memiliki panjang WX dan XY berturut-turut adalah 7 dan 24. Jika persegi Panjang tersebut dimisalkan sebagai sebuah kertas dan kertas tersebut dilipat mengikuti diagonal WY dengan X&rsquo; merupakan posisi titik X setelah kertasnya dilipat, maka Panjang X&rsquo;Z adalah &hellip;</p>', '', '', '', '', '', 'JWB_A_2.png', 'JWB_B_2.png', 'JWB_C_2.png', 'JWB_D_2.png', 'JWB_E_2.png', 'B', 3),
(320, '3', 'type_c', '<p>Perhatikan gambar berikut.</p>\r\n<p><img src="data:image/png;base64," alt="" /></p>\r\n<p>Jika &ang;AXB=&theta; dan &ang;COD=&gamma;, maka &ang;AOB=â‹¯&nbsp;</p>\r\n<p>&nbsp;</p>', '(1/2) (Î¸-Î³)', '2Î¸+Î³', 'Î¸-2Î³', '2Î¸-Î³', 'Î¸+Î³', 'JWB_A_3.', 'JWB_B_3.', 'JWB_C_3.', 'JWB_D_3.', 'JWB_E_3.', 'B', 2),
