(323, '6', 'type_c', '<p>Jika rata-rata 30 bilangan bulat nonnegatif berbeda adalah 30, maka bilangan terbesar yang mungkin adalah...&nbsp;</p>', '221', '229', '859', '239', '494', 'JWB_A_6.', 'JWB_B_6.', 'JWB_C_6.', 'JWB_D_6.', 'JWB_E_6.', 'E', 2),
(324, '7', 'type_c', '<p>Dua buah dadu dengan sisinya dicat merah dan biru. Dadu pertama terdiri dari 2 sisi merah dan 4 sisi biru. Jika kedua dadu tersebut dilempar, maka peluang munculnya sisi dadu berwarna sama adalah (1/3). Jumlah sisi dadu kedua yang berwarna biru adalah &hellip;</p>', '3', '4', '5', '6', '0', 'JWB_A_7.', 'JWB_B_7.', 'JWB_C_7.', 'JWB_D_7.', 'JWB_E_7.', 'E', 3),
(325, '8', 'type_c', '<p>Segiempat PQRS adalah sebuah trapesium dengan PSâˆ¥QR, digambarkan pada bidang koordinat kartesius. Diketahui PQ tegak lurus QR, P (0,6), Q (8,6) dan S (0,2). Titik R terletak pada sumbu ð‘¥. Jika luas persegi dengan koordinat (0,0), (1,0), (1,1), dan (0,1) adalah 8 satuan luas, maka luas PQRS adalah.....&nbsp;</p>', '280', '180', '320', '240', '160', 'JWB_A_8.', 'JWB_B_8.', 'JWB_C_8.', 'JWB_D_8.', 'JWB_E_8.', 'D', 2),
