(328, '11', 'type_c', '<p>Diberikan belah ketupat PQRS. Titik A, B, C, dan D berturut-turut merupakan titik berat segitiga PQR, QRS, RSP, dan SPQ. Jika perbandingan luas belah ketupat ABCD dan PQRS dapat dinyatakan sebagai m âˆ¶ n, maka nilai dari m - n adalah&hellip;&nbsp;</p>', '-5', '-2', '10', '-8', '7', 'JWB_A_11.', 'JWB_B_11.', 'JWB_C_11.', 'JWB_D_11.', 'JWB_E_11.', 'D', 4),
(329, '12', 'type_c', '<p>Surveyor ingin membuat suatu perumahan berbentuk lingkaran dengan pusat (0,0) dan berjari-jari 2 satuan. Jika semua rumah dalam perumahan tersebut berada pada koordinat bilangan bulat, maka peluang dua buah rumah berjarak lebih dari 3 satuan dapat dinyatakan dalam m/n dengan m,n relatif prima. Nilai dari m + n adalah&hellip;</p>\r\n<div id="gtx-trans" style="position: absolute; left: -126px; top: -12px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', '47', '43', '49', '44', '53', 'JWB_A_12.', 'JWB_B_12.', 'JWB_C_12.', 'JWB_D_12.', 'JWB_E_12.', 'D', 4),
