(334, '17', 'type_c', '<p>Titik (m,m) direfleksikan terhadap sumbu-x. Kemudian dirotasikan dengan pusat (0,0) sebesar 30&deg;. Agar Kembali ke titik (m,m), titik harus dirotasikan dengan pusat (0,0) sebesar&hellip;</p>', '120Â°', '150Â°', '180Â°', '210Â° ', '60Â°', 'JWB_A_17.', 'JWB_B_17.', 'JWB_C_17.', 'JWB_D_17.', 'JWB_E_17.', 'E', 3),
