(336, '19', 'type_c', '<p><img src="data:image/png;base64," alt="" width="591" height="43" /></p>', '40', '20', '25', '30', '35', 'JWB_A_19.', 'JWB_B_19.', 'JWB_C_19.', 'JWB_D_19.', 'JWB_E_19.', 'D', 4),
(337, '20', 'type_c', '<p>Thania ingin berkenalan dengan 14 teman sekelasnya yang baru. Jika ia dapat berkenalan dengan dua atau tiga anak sekaligus, maka banyak cara Thania untuk berkenalan dengan teman sekelasnya yang baru adalah&hellip;&nbsp;&nbsp;</p>', '8', '10', '12', '16', '15', 'JWB_A_20.', 'JWB_B_20.', 'JWB_C_20.', 'JWB_D_20.', 'JWB_E_20.', 'D', 4),
(338, '21', 'type_c', '<p>Lapisan atmosfer yang merupakan tempat munculnya aurora dan disebut sebagai lapisan panas (hot layer) disebut &hellip;</p>', 'Eksosfer', 'Stratosfer', 'Mesosfer', 'Troposfer', 'Termosfer', 'JWB_A_21.', 'JWB_B_21.', 'JWB_C_21.', 'JWB_D_21.', 'JWB_E_21.', 'E', 2),
(339, '22', 'type_c', '<p>Benda-benda&nbsp; serpihan yang berada di Tata surya, kadang ditarik oleh gravitasi planet yang jatuh dan masuk ke dalam atmosfer bumi tetapi tidak mencapai permukaan bumi disebut&hellip;..</p>', 'Meteor', 'Asteroid', 'Meteoroid', 'Meteorit', 'Komet', 'JWB_A_22.', 'JWB_B_22.', 'JWB_C_22.', 'JWB_D_22.', 'JWB_E_22.', 'A', 2),
(340, '23', 'type_c', '<p>Dalam&nbsp; ilmu&nbsp; geologi,&nbsp; terdapat&nbsp; hukum-hukum&nbsp; dasar&nbsp; terkait&nbsp; fenomena&nbsp; alam.&nbsp; Salah satunya adalah dalam keadaan normal lapisan&nbsp; muda&nbsp; bisa berada disamping lapisan tua, Pernyataan tersebut merupakan bunyi dari&hellip;.</p>', 'Hukum akresi lateral ', 'Hukum superposisi ', 'Hukum inklusi ', 'Hukum initial horizontality ', 'Hukum uniformitarianism', 'JWB_A_23.', 'JWB_B_23.', 'JWB_C_23.', 'JWB_D_23.', 'JWB_E_23.', 'A', 2),
(341, '24', 'type_c', '<p>Tipe pola curah hujan yang biasa terjadi di wilayah Pulau Kalimantan dan Sumatra adalah&hellip;.</p>', 'Hujan Ekuatorial', 'Hujan Monsunal', 'Hujan Lokal', 'Hujan Orografis', 'Hujan Frontal', 'JWB_A_24.', 'JWB_B_24.', 'JWB_C_24.', 'JWB_D_24.', 'JWB_E_24.', 'A', 2),
(342, '25', 'type_c', '<p>Organisme yang hidup bebas di lautan yang bisa melawan arus dan gerakannya atas kesadaran hewan itu sendiri disebut&hellip;.</p>', 'Neritik', 'Bentonik', 'Planktonik', 'Nektonik', 'Epitonik', 'JWB_A_25.', 'JWB_B_25.', 'JWB_C_25.', 'JWB_D_25.', 'JWB_E_25.', 'D', 2),
(343, '26', 'type_c', '<p>Berikut merupakan ciri-ciri yang umum terdapat pada bentang alam eolian, kecuali&hellip;.</p>', 'Disebabkan oleh dua proses pembentukan, seperti erosi oleh air dan angin.', 'Hasil dari bentang alam akibat dari suatu deflasi adalah cekungan deflasi', 'Pada lokasi terjadi bentang alam tidak terdapat sebuah vegetasi.', 'Terdapatnya endapan sedimen lumpur berwarna merah (terrarosa)', 'Dipengaruhi oleh adanya kecepatan dan arah angin', 'JWB_A_26.', 'JWB_B_26.', 'JWB_C_26.', 'JWB_D_26.', 'JWB_E_26.', 'E', 2),
(344, '27', 'type_c', '<p>Grafik perbandingan antara salinitas air laut dengan kedalaman akan menunjukkan bahwa salinitas air tinggi semakin ke perairan dalam salinitasnya semakin rendah dan tetap rendah sampai ke perairan paling dalam. Zona dimana salinitas mengalami perubahan besar disebut &hellip;..</p>', 'Haloklin', 'Termoklin', 'Termohalin', 'Saliklin', 'Pinoklin', 'JWB_A_27.', 'JWB_B_27.', 'JWB_C_27.', 'JWB_D_27.', 'JWB_E_27.', 'A', 3),
(345, '28', 'type_c', '<p>Pada suatu hari pada tanggal 30 Desember di kota Perth terjadi musim panas, sedangkan di kota Athena pada saat waktu yang sama terjadi&hellip;..</p>', 'Musim Semi', 'Musim Gugur', 'Musim Dingin', 'Musim Panas', 'Musim Hujan', 'JWB_A_28.', 'JWB_B_28.', 'JWB_C_28.', 'JWB_D_28.', 'JWB_E_28.', 'C', 3),
(346, '29', 'type_c', '<p>Kala&nbsp; yang&nbsp; memiliki&nbsp; rentang&nbsp; waktu&nbsp; sekitar&nbsp; 37 - 58 juta tahun&nbsp; yang&nbsp; lalu pada masa ini ditemukan tumbuhan rumput pertama kali adalah &hellip;..</p>', 'Pliosen', 'Oligosen', 'Miosen', 'Pleistosen', 'Eosen', 'JWB_A_29.', 'JWB_B_29.', 'JWB_C_29.', 'JWB_D_29.', 'JWB_E_29.', 'E', 3),
(347, '30', 'type_c', '<p>Bila ada benda lain berukuran mirip  Mars, berada di orbit Mars dan mengorbit Matahari, maka&hellip;.</p>', 'Suatu saat benda tersebut dapat menabrak Mars, menyebabkan keduanya hancur dan membentuk benda-benda kecil seperti asteroid ', 'Benda tersebut dan Mars tidak akan bertabrakan, dan sistem Tata Surya tetap seperti saat ini ', 'Akibat tabrakan benda tersebut dengan Mars akan mengubah stabilitas sistem Tata Surya. ', 'Akibat tabrakan benda tersebut dengan Mars, mengubah orbit Mars mendekat ke Matahari. ', 'Akibat tabrakan benda tersebut dengan Mars, mengubah orbit Mars menjauh dari Matahari', 'JWB_A_30.', 'JWB_B_30.', 'JWB_C_30.', 'JWB_D_30.', 'JWB_E_30.', 'B', 3),
(348, '31', 'type_c', '<p>Kita&nbsp; mengenal tentang&nbsp; arus&nbsp; laut, dimana arus&nbsp; laut dapat disebabkan karena perbedaan suhu air laut, perbedaan densitas,&nbsp; angin dan sebagainya. Arus yang melawati perairan Jepang yang mempunyai temperatur lebih tinggi dari perairan sekitarnya disebut &hellip;..</p>', 'Oyashio Current  ', 'Kuroshio Current ', 'Arlindo Current ', 'Density Current ', 'Equator Current', 'JWB_A_31.', 'JWB_B_31.', 'JWB_C_31.', 'JWB_D_31.', 'JWB_E_31.', 'B', 3),
(349, '32', 'type_c', '<p>Apa yang dimaksud dengan galaksi tak beraturan adalah&hellip;</p>', 'Debu dan gas sedikit, tersusun dari bintang-bintang tua', 'Kaya akan gas dan debu, tersusun dari bintang-bintang tua', 'Debu dan gas banyak, tersusun dari bintang-bintang tua dan muda', 'Kaya akan gas dan debu, tersusun dari bintang-bintang muda', 'Debu dan gas sedikit, tersusun dari bintang-bintang muda', 'JWB_A_32.', 'JWB_B_32.', 'JWB_C_32.', 'JWB_D_32.', 'JWB_E_32.', 'C', 3),
(350, '33', 'type_c', '<p>Salah&nbsp; satu komponen&nbsp; penting pembentuk&nbsp; mineral&nbsp; seperti&nbsp; emas&nbsp; dan&nbsp; tembaga&nbsp; di Papua&nbsp; adalah intrusi batuan beku.&nbsp; lntrusi tersebut&nbsp; merupakan&nbsp; batuan&nbsp; beku&nbsp; dalam plutonik, umumnya berwarna hitam, Mineralnya berbutir kasar hingga sedang, mineral pembentuknya yang paling banyak adalah plagioklas dan piroksen. Seperti pada gambar dibawah ini. Batuan tersebut&nbsp; adalah ..</p>\r\n<p><img src="images/K5.jpg" alt="" width="181" height="168" /></p>', 'Diorit', 'Granit', 'Peridotit', 'Gabro', 'Riolit', 'JWB_A_33.', 'JWB_B_33.', 'JWB_C_33.', 'JWB_D_33.', 'JWB_E_33.', 'D', 4),
(351, '34', 'type_c', '<p>Pada tanggal 13 Juli 2020 terjadi gempa bumi di Yogyakarta yang mengakibatkan infrastruktur rusak, sehingga untuk antisipasi di masa depan, pemerintah perlu untuk membangun infrastruktur yang berkualitas, dapat diandalkan, berkelanjutan dan tahan lama sesuai dengan SGDs tujuan ke-9. Setelah diteliti, penyebab dari gempa tersebut adalah&nbsp; pergerakan&nbsp; sesar&nbsp; yang&nbsp; dipicu&nbsp; oleh&nbsp; tumbukan&nbsp; antara&nbsp; dua&nbsp; lempeng.&nbsp; Kedua&nbsp; lempeng tersebut adalah &hellip;</p>', 'Lempeng Indo-Australia dan lempeng Pasifik ', 'Lempeng Pasifik dan lempeng Eurasia ', 'Lempeng Eurasia dan lempeng Indo-Australia ', 'Lempeng Indo-Australia dan lempeng Filipina', 'Lempeng Filipina dan lempeng Eurasia', 'JWB_A_34.', 'JWB_B_34.', 'JWB_C_34.', 'JWB_D_34.', 'JWB_E_34.', 'C', 4),
(352, '35', 'type_c', '<p><img src="images/K6.jpg" alt="" width="275" height="183" /></p>\r\n<p>Jenis awan yang menjulang tinggi biasanya mirip seperti menara atau kastel kecil seperti pada gambar di atas adalah awan &hellip;</p>', 'Altocumulus Undulatus', 'Altocumulus Lentikularis', 'Altocumulus Stratiform', 'Altocumulus Castelanus ', 'Altocumulus Humilis', 'JWB_A_35.', 'JWB_B_35.', 'JWB_C_35.', 'JWB_D_35.', 'JWB_E_35.', 'D', 4),
(353, '36', 'type_c', '<p>Magnitudo mutlak sebuah bintang adalah M=15 dan magnitudo semunya adalah m=20. Jika absorpsi oleh materi antar bintang diabaikan, berapakah jarak antara bintang tersebut?</p>', '150 parsek', '100 parsek', '80 parsek', '50 parsek', '120 parsek', 'JWB_A_36.', 'JWB_B_36.', 'JWB_C_36.', 'JWB_D_36.', 'JWB_E_36.', 'B', 4),
(354, '37', 'type_c', '<p><img src="images/K7.jpg" alt="" width="213" height="237" /></p>\r\n<p>Perhatikan Alat diatas! Alat ini disebut ..... dan digunakan untuk mengukur&hellip;</p>', 'Pyranometer, mengukur penyinaran  matahari', 'Ceilometer, mengukur tinggi dasar awan', 'Barometer, mengukur perbedaan tekanan', 'Anemometer, mengukur kecepatan angin', 'Termohigrograf, temperatur dan kelembaban udara', 'JWB_A_37.', 'JWB_B_37.', 'JWB_C_37.', 'JWB_D_37.', 'JWB_E_37.', 'B', 4),
(355, '38', 'type_c', '<p>Teori gelombang yang menyatakan bahwa gaya gesek angin dengan permukaan air laut yang akan&nbsp; membangkitkan&nbsp; gelombang&nbsp; &nbsp; dibuat&nbsp; pertama&nbsp; kali&nbsp; oleh&nbsp; Admiral&nbsp; Sir&nbsp; Francis&nbsp; Beaufort (1808) yang kemudian dikenal sebagai skala angin Beaufort. Pernyataan kondisi angin yang terdapat di bawah ini yang paling benar adalah&hellip;..</p>', 'Angin gentle breeze,  mempunyai  ciri  kecepatan  angin  21  -  26  knot  atau  39 - 49 m/dt,   ', 'Angin gentle breeze, mempunyai ciri kecepatan angin 4 - 6 knot atau 1,6 - 3,3 m/dt,   ', 'Angin gentle  breeze,  mempunyai  ciri  kecepatan  angin    7  -  10  knot  atau  3,4  -  5,4 m/dt,   ', 'Angin gentle breeze, mempunyai ciri kecepatan angin 17 - 121 knot atau 8,0 - 10,7 m/dt,   ', 'Angin gentle  breeze,  mempunyai  ciri  kecepatan  angin  11  -  16  knot  atau  5,5  -  7,9 m/dt', 'JWB_A_38.', 'JWB_B_38.', 'JWB_C_38.', 'JWB_D_38.', 'JWB_E_38.', 'C', 4),
(356, '39', 'type_c', '<p>Berapakah gaya Coriolis yang terjadi di sebuah kota yang terletak di lintang 60&deg; LS menggunakan Rumus Gaya Coriolis dengan &omega; adalah Kecepatan sudut bumi 2.5 x 10^3 Rad/s dan kecepatan angin 10 m/s dan kemana pembelokannya&hellip;</p>', '4.3 x 10^3 ke arah kanan ', '4.3x 10^3 ke arah kiri ', '4.3  x 10^4 ke arah kanan ', '4.3 x 10^4  ke arah kiri ', 'Tidak ada yang benar', 'JWB_A_39.', 'JWB_B_39.', 'JWB_C_39.', 'JWB_D_39.', 'JWB_E_39.', 'D', 4),
(357, '40', 'type_c', '<p>Alat dibawah merupakan salah satu instrumen oseanografi yang berguna untuk&hellip;&hellip;.</p>\r\n<p><img src="images/K8.jpg" alt="" width="161" height="169" /></p>\r\n<div id="gtx-trans" style="position: absolute; left: -126px; top: -12px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', 'Mengukur gelombang laut', 'Mengukur arus laut', 'Mengukur pasang surut', 'Mengukur salinitas air laut', 'Mengukur kedalaman laut', 'JWB_A_40.', 'JWB_B_40.', 'JWB_C_40.', 'JWB_D_40.', 'JWB_E_40.', 'D', 4),
(358, '41', 'type_c', '<p>Alat ukur theodolite memiliki kemampuan membaca salah data dibawah ini&hellip;.</p>', 'Cuaca ', 'Sudut ', 'Arus', ' Kecepatan ', 'Suhu', 'JWB_A_41.', 'JWB_B_41.', 'JWB_C_41.', 'JWB_D_41.', 'JWB_E_41.', 'B', 2),
(359, '42', 'type_c', '<p>Jarak sebenarnya adalah 40,5 km. Maka jarak pada peta jika menggunakan skala 1:150000 adalah &hellip;.</p>', '27 cm', ' 27,5 m ', '2,7 m ', '27 m', ' 2,7 cm', 'JWB_A_42.', 'JWB_B_42.', 'JWB_C_42.', 'JWB_D_42.', 'JWB_E_42.', 'A', 2),
(360, '43', 'type_c', '<p><img src="images/GT3C.png" alt="" width="250" height="219" /></p>\r\n<p>Perhatikan gambar alat ukur di atas!<br />Berdasarkan gambar kompas diatas, disebut apakah no 3&hellip;..</p>', 'Jarum penunjuk azimuth ', 'Garis pembidik', 'Jarum penunjuk ', 'Pengunci ', 'Nivo tabung', 'JWB_A_43.', 'JWB_B_43.', 'JWB_C_43.', 'JWB_D_43.', 'JWB_E_43.', 'B', 2),
(361, '44', 'type_c', '<p>Metode pemetaan topografi dengan cara melakukan kontak langsung dengan objek di lapangan merupakan metode pengukuran&hellip;.</p>', 'Fotogrametri', ' Terestris ', 'Digitasi ', 'Barometris  ', 'Remote sensing', 'JWB_A_44.', 'JWB_B_44.', 'JWB_C_44.', 'JWB_D_44.', 'JWB_E_44.', 'B', 2),
(362, '45', 'type_c', '<p>Berikut adalah alat&nbsp; yang dapat digunakan untuk mendigitalisasi peta analog ke peta digital adalah &hellip;&hellip;</p>', 'Scanner ', 'Fotocopy ', 'Tinta ', 'Computer', ' Jangka', 'JWB_A_45.', 'JWB_B_45.', 'JWB_C_45.', 'JWB_D_45.', 'JWB_E_45.', 'A', 2),
(363, '46', 'type_c', '<p>Berikut adalah yang bukan salah satu faktor yang mendukung pengaruh implementasi Sistem Informasi Geospasial (SIG) dalam kerja adalah&hellip;</p>', 'Biaya Tenaga kerja Data', 'Tenaga kerja ', 'Data', 'Dukungan manajemen ', 'Pembangunan', 'JWB_A_46.', 'JWB_B_46.', 'JWB_C_46.', 'JWB_D_46.', 'JWB_E_46.', 'D', 2),
(364, '47', 'type_c', '<p>Dalam proses kegiatan inderaja memiliki beberapa komponen pendukung. Komponen inderaja yang mempunyai fungsi untuk merambatkan panjang gelombang dan melanjutkan energi adalah&hellip;.</p>', 'Atmosfer ', 'Citra ', 'Sumber energi ', 'Sensor ', 'Tenaga', 'JWB_A_47.', 'JWB_B_47.', 'JWB_C_47.', 'JWB_D_47.', 'JWB_E_47.', 'E', 3),
(365, '48', 'type_c', '<p>GPS dapat digunakan untuk menentukan lokasi yang telah ditandai. Tanda tersebut terdiri dari&nbsp; koordinat lintang (latitude) dan bujur (longitude) dan biasanya digambarkan dalam bentuk titik dan simbol sesuai jenis lokasi adalah....</p>', 'Bearing ', 'Elevation', ' Mark ', 'Route ', 'Waypoint ', 'JWB_A_48.', 'JWB_B_48.', 'JWB_C_48.', 'JWB_D_48.', 'JWB_E_48.', 'E', 3),
(366, '49', 'type_c', '<p>Pengukuran kadaster yang mengukur luas persil menggunakan metode rangkaian segitiga, maka data yang akan diambil dalam formulir pengukuran antara lain adalah&hellip;..</p>', 'Ketinggian permukaan tanah ', 'Sudut ', 'Koordinat ', 'Jarak', ' Beda tinggi', 'JWB_A_49.', 'JWB_B_49.', 'JWB_C_49.', 'JWB_D_49.', 'JWB_E_49.', 'D', 3),
(367, '50', 'type_c', '<p>Letak dipermukaan bumi dapat ditentukan dengan bantuan penyelarasan (synchronization) sinyal satelit. Sebutkan nama satelit yang dikembangkan oleh Departemen Pertahanan Amerika Serikatâ€¦..</p>', 'GLONASS  ', 'NAVSTAR GPS ', 'IRNSS ', 'TIROS', ' NOAA', 'JWB_A_50.', 'JWB_B_50.', 'JWB_C_50.', 'JWB_D_50.', 'JWB_E_50.', 'B', 3),
(368, '51', 'type_c', '<p>Terdapat beberapa manfaat dari Sistem Informasi Geospasial (SIG) salah satunya dalam bidang manajemen sarana prasana yang termasuk manfaat yang dimiliki Sistem Informasi Geospasial (SIG) pada bidang ini adalah&hellip;..</p>', 'Sistem jaringan air bersih ', 'Memanfaatkan perubahan pembangunan lahan', 'Memprediksi tingkat kekeringan ', 'Menyusun rencana-rencana pembangunan ulang daerah bencana ', 'Menentukan tingkat bahaya erosi', 'JWB_A_51.', 'JWB_B_51.', 'JWB_C_51.', 'JWB_D_51.', 'JWB_E_51.', 'A', 3),
(369, '52', 'type_c', '<p><img src="images/GT112C.png" alt="" width="250" height="157" /></p>\r\n<p>Perhatikan gambar di atas!<br />Gambar diatas merupakan gambar peta kontur dari&hellip;.</p>', 'Bukit  ', 'Jalan ', 'Sungai', ' Dataran ', ' Laut ', 'JWB_A_52.', 'JWB_B_52.', 'JWB_C_52.', 'JWB_D_52.', 'JWB_E_52.', 'A', 3),
(370, '53', 'type_c', '<p>Berikut ini yang tepat dari tahapan reduksi jarak adalah&hellip;&hellip;</p>', 'Fisik bumi â€“ Ellipsoid â€“ Geoid â€“ Proyeksi  ', 'Fisik bumi â€“ Geoid â€“ Proyeksi â€“ Ellipsoid ', 'Fisik bumi â€“ Geoid â€“ Ellipsoid â€“ Proyeksi  ', 'Fisik bumi â€“ proyeksi â€“ Ellipsoid â€“ Geoid ', 'Fisik bumi â€“ Ellipsoid â€“ Proyeksi â€“ Geoid', 'JWB_A_53.', 'JWB_B_53.', 'JWB_C_53.', 'JWB_D_53.', 'JWB_E_53.', 'C', 4),
(371, '54', 'type_c', '<p><img src="images/GT14C.png" alt="" width="460" height="150" /></p>\r\n<p>Perhatikan hasil dari pengukuran beda tinggi di atas, kemudian akan diperoleh data beda tinggi antara titik P1 dan P2 sebesar &hellip;.</p>', '-0,375 m ', '-0,475 m ', '1,375 m ', '37,50 m ', '-0,425 m ', 'JWB_A_54.', 'JWB_B_54.', 'JWB_C_54.', 'JWB_D_54.', 'JWB_E_54.', 'A', 4),
(372, '55', 'type_c', '<p><img src="images/GT15C.png" alt="" width="240" height="164" /></p>\r\n<p>Diketahui polygon tertutup dengan sudut azimuth 135Ëš, jika &beta;1 adalah 80Ëš10&rsquo;20&rdquo;, &beta;2 adalah 60Ëš15&rsquo;30&rdquo; dan &beta;3 adalah 39Ëš34&rsquo;01&rdquo;. Koordinat titik A (100,0) tentukan nilai koordinat di titik B&hellip;.</p>', '165,4648 ; 42,4924 ', '146,3184 ; -53,3289', '156,3898 ; -44,0562 ', '175,7577 ; 55,7986 ', '230,2884 ; 46, 4289', 'JWB_A_55.', 'JWB_B_55.', 'JWB_C_55.', 'JWB_D_55.', 'JWB_E_55.', 'C', 4),
(373, '56', 'type_c', '<p>Berikut ini merupakan tahapan pengatur penyimpat datar setelah tripod/statif sudah berdiri di atas patok</p>\r\n<p>A.&nbsp;Putar kedua sekrup tersebut hingga gelembung nivo berada di tengah<br />B.&nbsp;Sejajarkan teropong dengan dua sekrup penyetal pada tribach<br />C.&nbsp;Putar teropong hingga tegak lurus dengan dua sekrup penyetel sebelumnya<br />D.&nbsp;Pasang pesawat di atas kepala statif dengan mengikat lendasan pesawat dan sekrup pengunci di kepala statif<br />E.&nbsp;Periksa Kembali dengan memutar teropong kesegala arah, jika gelembung nivo tidak berubah, maka alat siap digunakan<br />F.&nbsp;Putar satu sekrup tersisa hingga gelembung nivo tepat berada di tengah-tengah lingkaran nivo</p>\r\n<p>Bagaimana susunan pengaturan alat penyimpat datar yang tepat jika tripot/satif bediri di atas BM (Bench Mark)&hellip;&hellip;.</p>', 'D ; C ; B ; A ; F ; E', ' D ; B ; C ; F ; A ; E ', 'D ; B ; A ; C ; F ; E', 'D ; A ; C ; F ; B ; E ', 'D ; C ; A ; B ; F ; E', 'JWB_A_56.', 'JWB_B_56.', 'JWB_C_56.', 'JWB_D_56.', 'JWB_E_56.', 'C', 4),
(374, '57', 'type_c', '<p>Disebut apakah kesalahan yang disebabkan oleh sinyal yang diterima berasal dari lebih dari satu lintasan&hellip;.</p>', 'Sistematika', 'Acak ', 'Teknik ', 'Multipath ', 'Error', 'JWB_A_57.', 'JWB_B_57.', 'JWB_C_57.', 'JWB_D_57.', 'JWB_E_57.', 'D', 4),
(375, '58', 'type_c', '<p>Pada peta topografi dengan interval kontur 45 meter, tergambar 2 bukit dengan jarak antar puncaknya 15cm. Jarak sebenarnya dua puncak tersebut adalah&hellip;</p>', '15 km ', '13,5 km ', '17,5 km ', '11 km ', '10,5 km', 'JWB_A_58.', 'JWB_B_58.', 'JWB_C_58.', 'JWB_D_58.', 'JWB_E_58.', 'B', 4),
(376, '59', 'type_c', '<p>Citra foto yang dibuat dengan menggunakan semua spektum sinar tampak, mulai dari warna merah sampai warna ungu dinamakan foto&hellip;..</p>', 'Oblique ', 'Ortokromatik ', 'Pankromatik ', 'Multispectral', ' Inframerah', 'JWB_A_59.', 'JWB_B_59.', 'JWB_C_59.', 'JWB_D_59.', 'JWB_E_59.', 'C', 4),
(377, '60', 'type_c', '<p><img src="images/GT20C.png" alt="" width="217" height="214" /></p>\r\n<p>Perhatikan gambar peta kontur diatas! <br />Berapa skala peta yang digunakan pada gambar di atas&nbsp; &hellip;.</p>', '1:1000 ', '1:100000 ', '1:1000000 ', '1:2000000', ' 1:500000', 'JWB_A_60.', 'JWB_B_60.', 'JWB_C_60.', 'JWB_D_60.', 'JWB_E_60.', 'D', 4),
(378, '61', 'type_c', '<p>Sebuah bola bermassa 250 gram dilempar vertical dari permukaan tanah dengan kecepatan awal 10 m/s. Bila g = <img src="images/F_61c_1.png" alt="" width="56" height="21" />, maka usaha yang dilakukan gaya berat bola pada saat mencapai tinggi maksimum adalah&hellip;&nbsp;</p>', '15 joule', '17 joule', '17,5 joule', '12,5 joule', '15 joule', 'JWB_A_61.', 'JWB_B_61.', 'JWB_C_61.', 'JWB_D_61.', 'JWB_E_61.', 'D', 3),
(379, '62', 'type_c', '<p>Sebuah balok bermassa 2 kg didorong ke atas oleh gaya konstan 15 N pada bidang miring seperti gambar</p>\r\n<p><img src="images/F_62c_1.png" alt="" width="167" height="99" /></p>\r\n<p>Anggap percepatan gravitasi&nbsp;<img src="images/F_62c_2.png" alt="" width="46" height="21" /> dan gesekan antara balok dan bidang miring nol. Usaha total yang dilakukan pada balok adalah&hellip;</p>', '10 joule', '8 joule', '12 joule', '6 joule', '2 joule', 'JWB_A_62.', 'JWB_B_62.', 'JWB_C_62.', 'JWB_D_62.', 'JWB_E_62.', 'A', 4),
(380, '63', 'type_c', '<p>Seseorang mempunyai berat badan 60 kg memanjat sebuah tiang hingga ketinggian 5 m. Untuk mencapai ketinggian tersebut harus menempuh waktu 10 detik. Maka daya yang dibutuhkan orang tersebut agar dapat memanjat pohon itu adalah&hellip;</p>', '250 watt', '650 watt', '300 watt', '200 watt', '100 watt', 'JWB_A_63.', 'JWB_B_63.', 'JWB_C_63.', 'JWB_D_63.', 'JWB_E_63.', 'C', 4),
(381, '64', 'type_c', '<p>Suatu partikel dengan massa 2 kg didorong dari permukaan meja hingga kecepatan pada saat lepas dari bibir meja = 4 m/s seperti pada gambar</p>\r\n<p><img src="images/F_64c_1.png" alt="" width="159" height="86" /></p>\r\n<p>Energi mekanik partikel saat ketinggiannya dari tanah = 1 m adalah&hellip;</p>', '60 joule', '45 joule', '67 joule', '70 joule', '56 joule', 'JWB_A_64.', 'JWB_B_64.', 'JWB_C_64.', 'JWB_D_64.', 'JWB_E_64.', 'E', 4),
(382, '65', 'type_c', '<p>Perhatikan gambar berikut!</p>\r\n<p><img src="images/F_65c_1.png" alt="" width="176" height="89" /></p>\r\n<p>Sebuah benda dengan massa 20 kg meluncur ke bawah sepanjang bidang miring licin yang membentuk sudut 30&deg; terhadap bidang horizontal. Jika benda bergeser sejauh 2 m, maka hitunglah usaha yang dilakukan oleh gaya berat!</p>', '400 joule', '273 joule', '200 joule', '355 joule', '100 joule', 'JWB_A_65.', 'JWB_B_65.', 'JWB_C_65.', 'JWB_D_65.', 'JWB_E_65.', 'C', 4),
(383, '66', 'type_c', '<p>Sebuah zat cair memiliki massa jenis&nbsp;<img src="images/F_66c_1.png" alt="" width="75" height="23" /> dimasukkan ke dalam sebuah bejana berbentuk tabung dengan jari-jari tabung adalah 20 cm. Jika massa zat cair tersebut adalah 750 Kg, maka tentukanlah tekanan hidrostatis pada dasar tabung tersebut?(gunakan g =<img src="images/F_66c_2.png" alt="" width="43" height="16" />)</p>', '', '', '', '', '', 'JWB_A_66.png', 'JWB_B_66.png', 'JWB_C_66.png', 'JWB_D_66.png', 'JWB_E_66.png', 'A', 3),
(384, '67', 'type_c', '<p>Seorang penangkap ikan tradisional mampu menyelam hingga kedalaman 10 meter di bawah permukaan laut. Jika massa jenis air laut adalah&nbsp;<img src="images/F_67c_1.png" alt="" width="60" height="17" /> dan tekanan atmosfer di atas permukaan air adalah 1 atm. Tentukan tekanan total yang di rasakan oleh penyelam tersebut? (Gunakan percepatan gravitasi <img src="images/F_67c_2.png" alt="" width="44" height="17" />)</p>', '3 atm', '1 atm', '2 atm', '1,5 atm', '2,5 atm', 'JWB_A_67.', 'JWB_B_67.', 'JWB_C_67.', 'JWB_D_67.', 'JWB_E_67.', 'C', 4),
(385, '68', 'type_c', '<p>Perbandingan diameter pipa kecil dan pipa besar dari sebuah alat berdasarkan prinsip Pascal adalah 1:15. Jika alat tersebut digunakan untuk mengangkat beban seberat 3600 N. Maka besar gaya yang harus diberikan adalah&hellip;</p>', '240 N', '225 N', '300 N', '180 N', '150 N', 'JWB_A_68.', 'JWB_B_68.', 'JWB_C_68.', 'JWB_D_68.', 'JWB_E_68.', 'A', 2),
(386, '69', 'type_c', '<p>Seutas tali lurus Panjang membujur dari Barat ke Timur, dialiri arus listrik dari arah Timur. Arah medan magnet pada titik-titik di atas kawat tersebut menuju ke arah&hellip;</p>', 'Selatan', 'Tenggara', 'Barat Laut', 'Utara', 'Timur Laut', 'JWB_A_69.', 'JWB_B_69.', 'JWB_C_69.', 'JWB_D_69.', 'JWB_E_69.', 'D', 2),
(387, '70', 'type_c', '<p>Sebanyak 8 mol suatu gas ideal suhunya 47&deg; C memuai secara isothermal dari&nbsp;<img src="images/F_70c_1.png" alt="" width="26" height="22" /> menjadi <img src="images/F_70c_2.png" alt="" width="28" height="16" />. Tentukan usaha yang dilakukan oleh gas jika menggunakan tetapan gas umum R = 8,31 J/mol K</p>', '15.765 J', '18.025 J', '17.250 J', '19.565 J', '17.435 J', 'JWB_A_70.', 'JWB_B_70.', 'JWB_C_70.', 'JWB_D_70.', 'JWB_E_70.', 'B', 2),
(388, '71', 'type_c', '<p>Suatu gas menerima kalor 5000 kalori, menghasilkan usaha sebesar 10.000 J. Berapakah perubahan energi dalam pada gas? (1 kalori = 4,8 joule)</p>', '10.000 J', '12.000 J', '11.300 J', '12.500 J', '10.900 J', 'JWB_A_71.', 'JWB_B_71.', 'JWB_C_71.', 'JWB_D_71.', 'JWB_E_71.', 'E', 2),
(389, '72', 'type_c', '<p>Ikhsan yang menderita rabun dekat mempunyai titik dekat 50 cm. Jika ingin membaca dengan jarak normal (25 cm), maka berapa kekuatan lensa kacamata yang harus dipakai Ikhsan?</p>', '3 dioptri', '2 dioptri', '1,5 dioptri', '2,5 dioptri', '1 dioptri', 'JWB_A_72.', 'JWB_B_72.', 'JWB_C_72.', 'JWB_D_72.', 'JWB_E_72.', 'B', 3),
(390, '73', 'type_c', '<p>Sebuah benda setinggi 1 cm berada di depan lensa cekung dengan fokus 2 cm. Jika jarak benda 6 cm maka tentukanlah perbesaran bayangan!</p>', '1/3 kali', '2 kali', '2,5 kali', '3/4 kali', '3 kali', 'JWB_A_73.', 'JWB_B_73.', 'JWB_C_73.', 'JWB_D_73.', 'JWB_E_73.', 'A', 3),
(391, '74', 'type_c', '<p>Sebuah benda yang bermassa 200 gram diikat dengan tali ringan kemudian diputar secara horizontal dengan kecepatan sudut tetap sebesar <img src="images/F_74c_1.png" alt="" width="58" height="20" />, seperti pada gambar berikut. Jika panjang tali l = 60 cm, maka besar gaya sentripetal yang bekerja pada benda adalah &hellip;</p>', '1,2 N', '2,4 N', '3 N', '2,5 N', '3,5 N', 'JWB_A_74.', 'JWB_B_74.', 'JWB_C_74.', 'JWB_D_74.', 'JWB_E_74.', 'C', 4),
(392, '75', 'type_c', '<p>Sebuah satelit bergerak dengan kelajuan konstan di dekat permukaan bumi. Satelit berada pada orbit melingkar mengelilingi pusat Bumi dengan percepatan <img src="images/F_75c_1.png" alt="" width="69" height="20" />. Berapa lama waktu yang diperlukan untuk melakukan satu putaran penuh mengelilingi Matahari? (R = 6.370 km)</p>', '83,9 menit', '80 menit', '87,6 menit', '82,5 menit', '84,3 menit', 'JWB_A_75.', 'JWB_B_75.', 'JWB_C_75.', 'JWB_D_75.', 'JWB_E_75.', 'E', 4),
(393, '76', 'type_c', '<p>Sebuah benda yang semula diam bergerak dengan percepatan tetap selama 10 sekon. Jika jarak yang ditempuh 50 m dan massa benda 5 kg, maka besar gaya yang bekerja adalah&hellip;</p>', '20 N', '35 N', '15 N', '10 N', '5 N', 'JWB_A_76.', 'JWB_B_76.', 'JWB_C_76.', 'JWB_D_76.', 'JWB_E_76.', 'D', 4),
(394, '77', 'type_c', '<p>Sebuah balok bermassa 5 kg (berat w = 50 N) digantung dengan tali dan diikatkan pada atap. Jika balok diam maka berapakah tegangan talinya?</p>', '35 N', '25 N', '40 N', '50 N', '65 N', 'JWB_A_77.', 'JWB_B_77.', 'JWB_C_77.', 'JWB_D_77.', 'JWB_E_77.', 'D', 2),
(395, '78', 'type_c', '<p>Jika dua buah planet memiliki massa&nbsp;<img src="images/F_78c_1.png" alt="" width="77" height="22" /> dan <img src="images/F_78c_2.png" alt="" width="71" height="24" />. Jarak antar dua planet adalah <img src="images/F_78c_3.png" alt="" width="60" height="18" />. Tentukanlah gaya gravitasi antar 2 planet!</p>', '', '', '', '', '', 'JWB_A_78.png', 'JWB_B_78.png', 'JWB_C_78.png', 'JWB_D_78.png', 'JWB_E_78.png', 'C', 3),
(396, '79', 'type_c', '<p>Galaksi jauh dalam konstelasi Hydra menjauhi bumi dengan kelajuan <img src="images/F_79c_1.png" alt="" width="106" height="24" />, berapa pergeseran garis spectral hijau dengan panjang gelombang 500nm yang di pancarkan oleh galaksi ini (ke arah merah dari spektrum itu)?</p>', '475 Nm', '615 Nm', '555 Nm', '725 Nm', '650 Nm', 'JWB_A_79.', 'JWB_B_79.', 'JWB_C_79.', 'JWB_D_79.', 'JWB_E_79.', 'B', 3),
(397, '80', 'type_c', '<p>Pemanfaatan gelombang elektromagnetik dalam pengobatan memiliki efek menyembuhkan dan dapat merusak. Jenis gelombang elektromagnetik yang energinya paling besar sehingga dapat merusak jaringan sel manusia adalah&hellip;</p>', 'Sinar X', 'Gelombang Makro', 'Gelombang Mikro', 'Sinar UV', 'Sinar Gamma', 'JWB_A_80.', 'JWB_B_80.', 'JWB_C_80.', 'JWB_D_80.', 'JWB_E_80.', 'E', 2),
(398, '81', 'type_c', '<p>Penambangan di Indonesia mayoritas menggunakan metode <em>open pit mining</em>. Undang-undang No. 4 Tahun 2009 tentang Pertambangan Mineral dan Batubara mewajibkan perusahaan pertambangan untuk melakukan reklamasi dan kegaiatan pascatambang atas areal tambang yang diusahakannya. Namun, ada perusahaan yang tidak melakukan reklamasi pasca tambang, alasannya karena&hellip;</p>', 'Pengurangan degradasi lahan pada daerah sepi penduduk kurang bermanfaat', 'Lahan bekas tambang dapat dijadikan sebagai lokasi wisata alam dengan potensi profit tinggi', 'Lahan bekas tambang dapat dijadikan sebagai tambak ikan karena mengandung unsur hara rendah', 'Kandungan pH pada air yang stabil sehingga sangat baik digunakan untuk pengairan lahan pertanian ', 'Tidak ada jawaban yang benar', 'JWB_A_81.', 'JWB_B_81.', 'JWB_C_81.', 'JWB_D_81.', 'JWB_E_81.', 'A', 4),
(399, '82', 'type_c', '<p>Penelitian pada tahun 2011 menunjukkan korelasi urban heat island effect di Jakarta dengan beberapa faktor. Di bawah ini yang termasuk dampak terjadinya kondisi tersebut adalah ...</p>', 'Green house gases di urban area Jakarta meningkat', 'Pemakaian energi listrik yang berkurang 80% dari keadaan normal', 'Peningkatan temperatur perkotaan akibat kemarau di Jakarta', 'Meningkatnya kepadatan penduduk', 'Kondisi lingkungan Jakarta yang semakin padat akibat urbanisasi', 'JWB_A_82.', 'JWB_B_82.', 'JWB_C_82.', 'JWB_D_82.', 'JWB_E_82.', 'A', 4),
(400, '83', 'type_c', '<p>Pukul 13.00 di Area Gedung Teknik Geomatika ITS, terukur cuaca cerah dengan temperature 35&deg;C dengan setiap 1m&sup3; udara mengandung uap air sebanyak 23,5 gram. Jika pada suhu maksimum yang sama dengan konsentrasi air maksimumnya adalah 27,3 gram, maka <strong>kelembaban udara relatif</strong> Area Gedung Teknik Geomatika ITS adalah&hellip;</p>', '86,0805%', '128,2025%', '67,8701%', '68,54%', '66,041%', 'JWB_A_83.', 'JWB_B_83.', 'JWB_C_83.', 'JWB_D_83.', 'JWB_E_83.', 'A', 4),
(401, '84', 'type_c', '<p>Guna menunjang aktivitas mahasiswa ITS, dibangun jalan Teknik Sipil, Teknik Perkapalan, Teknik Geomatika, dan Teknik Mesin Industri. Jalan-jalan tersebut ditujukan guna menghubungkan Departemen Teknik Geomatika, Departemen Teknik Komputer, Departemen Teknik Sistem Perkapalan, Departemen Teknik Lingkungan, Departemen Fisika, serta Departemen Diploma Sipil. Tingkat interaksi wilayah Kampus ITS adalah&hellip;</p>', '0,8', '0,7', '0,6', '1', '0,75', 'JWB_A_84.', 'JWB_B_84.', 'JWB_C_84.', 'JWB_D_84.', 'JWB_E_84.', 'C', 2),
(402, '85', 'type_c', '<p><img src="images/G_1pengembangan wilayah.png" alt="" width="413" height="232" />Perkembangan wilayah pada gambar cenderung menuju pusat pendidikan (ITS). Faktor apa yang menyebabkan kecenderungan wilayah terjadi seperti pada gambar?</p>', 'Bisnis rumah kos yang menguntungkan', 'Daerah ITS berada pada Kecamatan Sukolilo yang memiliki topografi datar', 'Mudahnya jalur transportasi akibat pembangunan yang masif di area tersebut', 'Banyaknya mahasiswa, menyebabkan bisnis retail meningkat', 'Berdekatan dengan Pantai Kenjeran yang merupakan daya tarik wisata Surabaya', 'JWB_A_85.', 'JWB_B_85.', 'JWB_C_85.', 'JWB_D_85.', 'JWB_E_85.', 'A', 3),
(403, '86', 'type_c', '<p>Interaksi antarwilayah pada Surabaya dan Mojokerto dapat ditingkatkan karena kedua wilayah dapat saling melengkapi kebutuhannya. Namun, ada juga bentuk interaksi yang tidak dapat saling melengkapi apabila wilayah-wilayah, bentuk tersebut adalah&hellip;</p>', 'memiliki potensi keunggulan yang berbeda-beda', 'mengembangkan program interaksi antarwilayah karena kedua wilayah saling berdekatan', 'memiliki kelebihan dan kekurangan yang dapat dipenuhi oleh suatu wilayah dengan wilayah lainnya', 'mengembangkan benuk komunikasi untuk berinteraksi antarwilayah memanfaatkan pembangunan infrastruktur yang baik', 'tidak ada jawaban yang benar', 'JWB_A_86.', 'JWB_B_86.', 'JWB_C_86.', 'JWB_D_86.', 'JWB_E_86.', 'C', 4),
(404, '87', 'type_c', '<p>Seorang mahasiswa Teknik Geomatika ITS melakukan survey lapangan yang menghasilkan beberapa variabel hingga menemukan bahwa wilayah tersebut rentan terhadap banjir. Karakteristik wilayah seperti apa yang menyebabkan mahasiswa Teknik Geomatika ITS dapat menyimpulkan bahwa wilayah tersebut rentan banjir</p>', 'Dataran endapan sungai yang kemirinagn tanahnya kurang dari 2%', 'Endapan aluvial yang permukaan tanahnya landai', 'Daerah pegunungan dengan aliran limpasan lambat', 'Bukit dataran tinggi sebagai hulu sungai', 'Endapan vulkanik dengan curah hujan tinggi', 'JWB_A_87.', 'JWB_B_87.', 'JWB_C_87.', 'JWB_D_87.', 'JWB_E_87.', 'A', 3),
(405, '88', 'type_c', '<p>Sebuah industri rumah tangga olahan ikan di Surabaya biasa mendapatkan stok ikan dari 237 nelayan Pantai Kenjeran serta menjualnya ke Pasar Manyar. Industri tersebut membutuhkan bahan baku 1,708 ton perharinya dengan hasil olahan jadinya mencapai 7016 kg. Di mana sebaiknya lokasi industri dibangun?</p>\r\n<div id="gtx-trans" style="position: absolute; left: 45px; top: 38.6px;">\r\n<div class="gtx-trans-icon">&nbsp;</div>\r\n</div>', 'Di dekat Pantai Kenjeran', 'Di dekat Pasar Manyar', 'Di tengah antara Pantai Kenjeran dan Pantai Manyar', 'Berada di Pantai Kenjeran', 'Berada di Pasar Manyar', 'JWB_A_88.', 'JWB_B_88.', 'JWB_C_88.', 'JWB_D_88.', 'JWB_E_88.', 'B', 4),
(406, '89', 'type_c', '<p>Penduduk Provinsi Jawa Tengah pada tahun 2021 sebanyak&nbsp; 39,74 juta terdapat kelhiran 600 ribu bayi. Pada Wanita kelompok umur 21-26 dengan jumlah 150 ribu jiwa, terjadi kelahiran sebanyak 23 ribu bayi. Berdasarkan data tersebut, angka kelahiran kelompok umur wanita adalah &hellip;</p>', '153,3', '148,8', '137,76', '149,76', '151,6', 'JWB_A_89.', 'JWB_B_89.', 'JWB_C_89.', 'JWB_D_89.', 'JWB_E_89.', 'A', 4),
(407, '90', 'type_c', '<p>Gunung&nbsp; Rinjani merupakan salah satu gunung aktif di Provinsi Nusa Tenggara Barat. Suatu Ketika muncul ciri-ciri sebagai berikut:</p>\r\n<p>(1) adanya peningkatan intensif kegiatan seismik</p>\r\n<p>(2) aktivitas gunung api dapat berlanjut</p>\r\n<p>(3) jika aktivitas seismik meningkat, letusan dapat terjadi dalam waktu 2 pekan</p>\r\n<p>Berdasarkan ciri-ciri tersebut, maka aktivitas gunung api menunjukkan status &hellip;</p>', 'Normal', 'Awas', 'Siaga', 'Waspada II', 'Waspada II', 'JWB_A_90.', 'JWB_B_90.', 'JWB_C_90.', 'JWB_D_90.', 'JWB_E_90.', 'C', 2),
(408, '91', 'type_c', '<p>Mitigasi bencana dapat dilakukan dengan cara mengurangi <em>vulnerability</em> penduduk dan pemerintah. Cara untuk mengurangi <em>vulnerability</em> terlihat pada tindakan berikut, kecuali...&nbsp;</p>', 'Tidak mendirikian permukiman di lereng yang curam', 'Tidak mengikuti rambu petunjuk evakuasi', 'Tidak mendirikan bangunan di sempadan sungai', 'Tidak membuang sampah ke sungai', 'Tidak menyalahi aturan perizinan lokasi dan prinsip', 'JWB_A_91.', 'JWB_B_91.', 'JWB_C_91.', 'JWB_D_91.', 'JWB_E_91.', 'B', 2),
(409, '92', 'type_c', '<p><strong><em>Blue carbon</em></strong> merupakan scenario efektif dalam pengurangan emisi dunia. Indonesia sebagai negara kepulauan terbesar memiliki potensi tinggi dalam pemanfaatan blue carbon. Namun, pemanfaatannya hingga kini belum optimal, Bagaimana Langkah konkret masyarakat guna mewujudkan <em>blue carbon</em> di Indonesia?</p>', 'Menghilangkan anggapan bahwa laut bukan komponen penting dalam penurunan emisi gas rumah kaca', 'Melakukan penelitian mendetail mengenai efektivitas bakau dan padang lamun di Indonesia yang masih minim penelitian', 'Pendataan Kawasan potensi blue carbon ', 'Mengurangi penggunaan green carbon guna mendorong peningkatan blue carbon', 'Tidak ada jawaban yang benar', 'JWB_A_92.', 'JWB_B_92.', 'JWB_C_92.', 'JWB_D_92.', 'JWB_E_92.', 'C', 3),
(410, '93', 'type_c', '<p>Indonesia merupakan negara dengan potensi pemanfaatan garis pantai tinggi, termasuk pada produksi garam. Namun dengan salinitas air laut Indonesia yang rendah menyebabkan produksi garam nasional rendah. Penyebabnya adalah&hellip;</p>', 'Curah hujan tinggi dan kondisi laut terbuka', 'Pasang surut rendah dan kelembaban udara tinggi', 'Musim kemarau pendek dan diapit dua samudra', 'Curah hujan tinggi dan berupa negara kepulauan', 'Kadar mineral air sungai rendah dan laut dangkal', 'JWB_A_93.', 'JWB_B_93.', 'JWB_C_93.', 'JWB_D_93.', 'JWB_E_93.', 'A', 3),
(411, '94', 'type_c', '<p>Pencurian ikan setahun ke belakang mengalami peningkatan setelah adanya moratorium pengeboman kapal asing pencuri ikan. Banyaknya ikan yang dicuri nelayan asing menyebabkan&hellip;</p>', 'Meningkatnya ekspor ikan Indonesia', 'Hilangnya supremasi batas negara', 'Nelayan di daerah pencurian ikan mengalami defisit tangkapan', 'Rusaknya ekosistem hayati', 'Tidak ada jawaban yang benar', 'JWB_A_94.', 'JWB_B_94.', 'JWB_C_94.', 'JWB_D_94.', 'JWB_E_94.', 'D', 2),
(412, '95', 'type_c', '<p>Saat akan melakukan pengambilan kenampakan permukaan bumi pada siang hari dengan sistem penginderaan jauh pasif, gambar yang dihasilkan kabur. Kondisi ini diduga akibat dari pengambilan data yang dilakukan pada saat cuaca mendung. Berdasarkan informasi tersebut, jenis hamburan yang menyebabkan hasil gambar menjadi kabur atau tidak jelas adalah &hellip;</p>', 'Hamburan umum', 'Hamburan Rayliegh', 'Hamburan mie', 'Hamburan non-selektif', 'Hamburan atmosfer', 'JWB_A_95.', 'JWB_B_95.', 'JWB_C_95.', 'JWB_D_95.', 'JWB_E_95.', 'C', 3),
(413, '96', 'type_c', '<p>Kesuburan tanah merupakan sifat lahan yang harus dipertahankan secara berkelanjutan dalam pembangunan pertanian. Namun, kenyataannya ada unsur hara yang hilang sehinga harus dilakukan upaya pencegahan melalui kegiatan-kegiatan berikut, kecuali&hellip;</p>', 'terasering', 'contour farming', 'crop rotation', 'contour ploughing ', 'strips cropping', 'JWB_A_96.', 'JWB_B_96.', 'JWB_C_96.', 'JWB_D_96.', 'JWB_E_96.', 'D', 3),
(414, '97', 'type_c', '<p>Indonesia merupakan negara yang dilewati garis khatulistiwa. Hal tersebut menyebabkan Indonesia berpotensi mengembangkan energi matahari sebagai alternatif energi. Adapun alasan dari potensi tersebut adalah &hellip;</p>', 'selalu panas setiap hari', 'Intensitas sinar matahari tinggi', 'Lama penyinaran harian tinggi', 'Hambatan awan tidak berarti', 'Absorbsi atmosfer rendah', 'JWB_A_97.', 'JWB_B_97.', 'JWB_C_97.', 'JWB_D_97.', 'JWB_E_97.', 'B', 4);
INSERT INTO `tryout_soal` (`id`, `no_soal`, `type_soal`, `soal`, `jwb_a`, `jwb_b`, `jwb_c`, `jwb_d`, `jwb_e`, `jwb_a_gbr`, `jwb_b_gbr`, `jwb_c_gbr`, `jwb_d_gbr`, `jwb_e_gbr`, `kunci`, `bobot_skor`) VALUES
(415, '98', 'type_c', '<p>Wilayah pesisir di Surabaya tidak cocok dimanfaatkan penduduk sebagai pemukiman karena&hellip;</p>', 'aksesibilitas rendah', 'kandungan air yang tinggi menyebabkan daya dukung tanah rendah', 'ketersediaan sarana prasarana', 'air tanah tidak tersedia dalam jumlah yang memadai', 'topografi yang datar', 'JWB_A_98.', 'JWB_B_98.', 'JWB_C_98.', 'JWB_D_98.', 'JWB_E_98.', 'C', 2),
(416, '99', 'type_c', '<p>Langkah yang harus diambil Indonesia untuk memanfaatkan peluang dalam konteks <strong>Indonesia-Malaysia-Thailand Growth Triangle (IMT-GT)</strong> adalah ...</p>', 'menghalangi budaya negative yang masuk Indonesia', 'memainkan peranan utama dalam perdagangan', 'meningkatkan kondisi infrastruktur perbatasan', 'mengirim tenaga kerja Indonesia ke luar negeri', 'meningkatkan hubungan diplomatic', 'JWB_A_99.', 'JWB_B_99.', 'JWB_C_99.', 'JWB_D_99.', 'JWB_E_99.', 'B', 4),
(417, '100', 'type_c', '<p>Dalam mempromosikan produknya, berbagai perusahaan memiliki parameter tertentu guna memetakan wilayah potensial. Adapun wilayah prioritas pemasaran bahan kebutuhan pokok seperti beras dan minyak goreng adalah wilayah yang &hellip;</p>', 'Pertumbuhan ekonominya tinggi', 'Pendidikan penduduknya rendah', 'Kepadatan penduduknya tinggi', 'Tingkat migrasi penduduknya rendah', 'Pertumbuhan penduduknya tinggi', 'JWB_A_100.', 'JWB_B_100.', 'JWB_C_100.', 'JWB_D_100.', 'JWB_E_100.', 'C', 2);
